INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('1AF9247E-8521-4D96-9972-96D4FA8F67F4', '重庆市南岸区茶园新区天文大道花街', '500401', 4360, 90, 663907, '500000', '2235898d-4c4b-40db-bc83-8712a0b63876', '500400', 372992, 35, 3095, '2054-01-29 00:00:00', 209.9700, 36.6800, '中交漫山', '重庆绿城物业管理有限公司', 5.0000, 4417, 50, 94, 1.33, '王诊铮', '13594082462', 66.0000, '一手商铺销售', '2018-12-15 00:00:00', '2019-06-30 00:00:00', '商铺', 90, 108, 18, 1, '2235898d-4c4b-40db-bc83-8712a0b63876', '106.64081649866044', '29.508611343327903', NULL, '106.634267', '29.50285', 16.320000, 199.700000, '2019/1/1AF9247E-8521-4D96-9972-96D4FA8F67F4/BD238B52-8EDE-4C44-BB49-99F964428AE0_360_215_ICON_1.jpg', 8, NULL, '3b58adf3-bb61-4215-9ca7-453e09365082', '2019-01-07 16:46:51', 1, '中交漫山地处茶园新区（重庆城市战略新高地），总占地约560亩，总建筑面积约70万方，项目择址茶园山水，同步城市发展脉搏，多维交通网络，主城各区畅行无阻。加之内环快速助力，让都市与自然、快节奏与漫生活亲密无间。以自然生态、舒氧康体，风尚乐活、亲子涵养、智能关怀、人文互动6大生活想象，包容生活的梦寐以求。以套内约135-156㎡漫坡创新联排、套内约105-134㎡依山灵动叠墅、套内约60-80㎡伴溪品质洋楼三大产品系，让情怀深入建筑肌理。 500强，国企中国交建自有其深厚底蕴。中交地产，作为房地产业务主体，以“雅颂天地，和美中国”为愿景，匠心打造更美好的都市生活。', '2019-01-07 14:16:45', '946cddf4-065c-43a7-88d1-b2c39b024c4f', '2019-07-01 10:54:08', '00d11ef7-7d32-4551-bd51-d8858db72611', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
