INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('2253c9f7-942d-4ba5-923e-88754810d12b', '金牛湖街道', '700907', 198, 5, 31781, '700000', '1b515b47-ad74-40d9-b52d-f547d3097c39', '700900', 14338, 31, 202, '2057-10-25 00:00:00', 178.8200, 105.4900, '弘阳时光山湖', '南京弘阳物业管理有限公司', 3.5000, 246, 40, 43, 1.6, '芮之', '13951938088', 31.0000, '一手商铺销售', '2019-07-08 00:00:00', '2019-09-30 00:00:00', '住宅', 21, 21, 0, 1, NULL, '118.9498117367788', '32.43316242613404', NULL, '118.943326', '32.427035', 44.140000, 75.490000, '2019/7/2253c9f7-942d-4ba5-923e-88754810d12b/2e11da20-1256-4293-84da-6ac960b12108_360_215_ICON_1.jpg', 8, NULL, '76145e5c-08f5-4621-b526-5af123636420', '2019-07-25 17:53:47', 8, '   弘阳时光山湖，是弘阳地产首进六合的诚意之作。六合板块作为江北新区副中心，地处苏皖两省、宁（南京）扬（扬州）滁（滁州）三市交会地，历来是沟通苏南、苏北、皖北的窗口。\n   项目位于六合区金牛湖街道，距离六合区市政府15.5公里，距离金牛湖风景区6公里，距离S8号线八百桥站仅400米。近距S247省道，出行便利。\n   项目所在的金牛湖街道小镇中心，居住氛围浓厚，生活基础配套齐全，周边学校、商业、医院环绕。											\n', '2019-07-25 16:50:04', '7a5db1ea-828c-4c9a-9758-188a9a113776', '2019-07-25 17:53:47', '7a5db1ea-828c-4c9a-9758-188a9a113776', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('248a2e26-1023-4197-b210-d7163d9ff9ff', '重庆市南岸区茶园刘家坝轻轨站旁', '500401', 3000, 95, 370000, '500000', 'c8b89668-e27a-46f1-a2a9-45abceec9e3b', '500400', 170000, 35, 2000, '2067-07-05 00:00:00', 331.5400, 40.8800, '荣盛华府', '荣盛物业管理有限公司', 3.5000, NULL, 50, 118, 1.5, '梁欣', '18623333805', 37.0000, '一手商铺销售', '2019-09-13 00:00:00', '2019-12-31 00:00:00', '商办项目', 111, 118, 2, 1, NULL, '106.65731899706851', '29.527307995536585', NULL, '106.650821', '29.521294', 32.280000, 192.610000, '2019/9/248a2e26-1023-4197-b210-d7163d9ff9ff/3c461476-dee2-436e-aa43-eba227544764_360_215_ICON_1.jpg', 8, '2019-08-18 17:33:10', '3b58adf3-bb61-4215-9ca7-453e09365082', '2019-09-18 17:33:10', 0, '荣盛华府，该项目位于茶园城市副中心，紧邻轻轨6号线刘家坪站（本小区为城南家园及附近小区人流到轻轨站的必经之路），位于真武山隧道/慈母山隧道/鹿角隧道（在建）及郭家沱大桥辐射区域内，背靠18万人流量的城南家园，小区自身以洋房/别墅为主体，自有业主2000户，已部分入住，自身带动高端消费。“1广场、2街、3业态”的格局规划，打造从购物、休闲到娱乐、餐饮的全业态。周边规划学校用地及现有天台岗小学划片。项目定位城市精英纯改善品质住区，涵盖宽境洋房、墅区洋楼、合院别墅和格调商业多元业态；2站直达解放碑，四隧四桥连四大繁华商区。自建约11万方潮流商业，周边商业、学校、医院一应俱全；将城市繁华与诗意生活完美融合，荣盛华府，值得被珍藏。', '2019-09-17 14:56:36', '81077bf5-898f-451d-89cc-1c1d1d27dfb5', '2019-09-18 16:37:01', '81077bf5-898f-451d-89cc-1c1d1d27dfb5', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('24dc0014-aa97-498f-a1f7-8cc030a6ea72', '浙江省杭州市江干区金沙大道377号', '710101', 600, 3, 105595, '710000', '774ede0a-b422-4673-814e-5488f6ce230c', '710100', 22291, 25, 867, '2050-08-25 00:00:00', 12.5000, 12.5000, '万亚名城', '杭州万康物业管理有限公司', 3.2000, 700, 40, 146, 3.2, '王辉', '13858073277', 10.5500, '车位销售', '2019-06-10 00:00:00', '2019-10-09 00:00:00', '公寓', 110, 136, 26, 1, '774ede0a-b422-4673-814e-5488f6ce230c', '120.33694458007812', '30.314945220947266', NULL, '120.330455', '30.308939', 15.000000, 15.000000, '2019/6/24dc0014-aa97-498f-a1f7-8cc030a6ea72/e5280734-a4ea-4299-b6fa-eb0bfb366a31_360_215_ICON_1.jpg', 8, NULL, 'ff601870-c85e-453a-8d33-35f7da193115', '2019-06-17 13:40:07', 8, '    万亚金沙湖1号规划为集酒店式公寓、特色时尚酒店、主题商场于一体的第五代都市尚品公馆，产品类型以LOFT为主，采用全新的居住理念和时尚的建筑风格，将引领杭城小户型的发展变革潮流。\n     万亚金沙湖1号距地铁1号线的中心站和下沙东站仅百余米，15分钟，即穿越市中心抵达金沙湖畔。九沙大道、延江景观大道、迎宾大道，绕城高速，江东大桥、九堡大桥“四纵四横二桥”，便捷完善的区内交通网络。距新的开发区管委会仅百米，北面是规划中的新城广场。该项目总建设面积约为105595平方米，由3幢高层组成，地下1层和地上2层为商业地产，地面3层以上为LOFT酒店式公寓。层高近5米，一套双层，随心所“寓”。金沙湖1号，结合水元素设计延绵起伏的律动回廊，独享最大愈65平方米的270度私家律动回廊，与家人享受更多阳光。\n    万亚金沙湖1号将成为城东新城CBD的标志性建筑物，波浪行的外观与金沙湖相呼应，独特的建筑文化将聚集一批有理想、有能力的精英人群；宜住、宜投资的建筑理念，引领杭州建筑新潮流。浙江绿城房地产咨询有限公司参与实施万亚金沙湖1号前期物业管理顾问咨询服务，进入万亚，吃住行全包的打造理念，将全面打造金沙湖板块城东新城最有价值的天堂。', '2019-06-14 15:07:28', '946cddf4-065c-43a7-88d1-b2c39b024c4f', '2019-07-02 16:47:46', '946cddf4-065c-43a7-88d1-b2c39b024c4f', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
