INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('274D8C16-F6B6-4B89-8D27-0731CB6D5FFD', '重庆市南岸区南坪正街1号丽华酒店', '500411', 259, 1, 11162, '500000', 'c3ec761b-66f9-4d57-8b91-85561c603373', '500400', 3512, 30, 185, '2043-12-31 00:00:00', 270.3700, 39.5300, '重庆丽华酒店', '重庆丽华酒店管理有限公司', 6.0000, 309, 24, 185, 3.5, '辛洪', '13908331528', 1.1200, '二手公寓', '2019-03-10 00:00:00', '2019-12-31 00:00:00', '公寓', 74, 186, 15, 1, NULL, '106.574776', '29.535983', NULL, '106.568347', '29.52969', 25.500000, 174.430000, '2019/3/274D8C16-F6B6-4B89-8D27-0731CB6D5FFD/C064BBEB-969C-4F3F-B059-8A106B91BE2D_360_215_ICON_1.jpg', 8, NULL, '3b58adf3-bb61-4215-9ca7-453e09365082', '2019-03-26 20:17:34', 8, '丽华酒店位于重庆南坪商圈，该酒店共七层，集吃、住、行、游、购、娱为一体，周围人流量大，配套齐全，轻轨3号线南坪站、工贸站均在600米范围内，且有多条公交线路。酒店4-7层公寓现房房源在售，主要为面积42-69㎡的精装loft、4.5米跃层，带10年四星级酒店10年返租经营，欢迎莅临。', '2019-03-15 09:36:13', '946cddf4-065c-43a7-88d1-b2c39b024c4f', '2019-07-14 18:07:06', '00d11ef7-7d32-4551-bd51-d8858db72611', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
