INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('29780354-0118-4684-92d5-b703f5ff8cac', '莲花街与长椿路交汇处', '1000702', 1000, 24, 1316700, '1000000', 'fb3df6aa-2dea-461a-a691-7f39e75a8a0f', '1000700', 376200, 35, 4000, '2083-10-20 00:00:00', 626.1600, 170.3100, '翰林国际城', '郑州鸿园物业管理有限公司', 3.6000, NULL, 70, 150, 3.5, '黄薇薇', '15638906166', 131.6700, '一手商铺销售', '2019-06-26 00:00:00', '2019-08-26 00:00:00', '住宅', 45, 52, 7, 1, NULL, '113.55311265840666', '34.83065059476042', NULL, '113.546613', '34.824585', 34.000000, 307.000000, '2019/7/29780354-0118-4684-92d5-b703f5ff8cac/d5df1594-7172-42fb-9b10-cbe610dffe69_360_215_ICON_1.jpg', 8, NULL, '0170817f-902e-42e6-8ab1-7e8a126ddd0a', '2019-07-05 14:09:56', 8, '翰林国际城由河南三德置业有限公司 ，位于郑州市高新区长椿路与莲花街交汇处东南角，邻 1号线站口，快速公交BRT站。翰林国际城周边有郑州大学、河南工业大学、郑大实验幼儿园、郑大 、郑州外国语等，翰林国际城内部规划有幼儿园 。项目由A、B、C、D四个组团组成，均采用封闭管理，地面采用人车分流。建筑外立面采用ArtDeco建筑风格三段式的设计理念，楼间距50米至100米，首层架空设计。翰林国际城景观园林设计采用法式景观园林，一期景观有沉香花园、凯旋文化广场、爱丽舍花园、塞纳河畔、枫丹白露、罗曼花园、枫情大道等景观组团。', '2019-07-05 13:20:49', 'e2752883-77bc-4eea-951d-d44756e21a95', '2019-07-08 09:48:31', 'e2752883-77bc-4eea-951d-d44756e21a95', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('2992a475-f063-4500-8ebd-7d4c687e76b9', '重庆市巴南区天鹿大道鹿角路口公交站东南', '500711', 957, 20, 160000, '500000', 'a7a45c93-bfe7-4c0c-a059-3316899a35c9', '500700', 64000, 35, 955, '2069-06-05 00:00:00', 183.3900, 86.2100, '美的荣安公园天下', '广东美的物业管理股份有限公司', 6.6000, NULL, 50, 36, 2, '何倩颍', '13657622855', 16.0000, '一手商铺销售', '2019-07-27 00:00:00', '2020-07-27 00:00:00', '住宅', 8, 36, 5, 1, NULL, '106.63363696891678', '29.46018505806923', NULL, '106.627049', '29.454481', 29.000000, 74.000000, '2019/7/2992a475-f063-4500-8ebd-7d4c687e76b9/c15f4adb-6d67-4698-8c56-49173d162ae9_360_215_ICON_1.jpg', 8, NULL, '3b58adf3-bb61-4215-9ca7-453e09365082', '2019-07-29 18:09:16', 8, '美的荣安公园天下，项目位于重庆市巴南区鹿角片区天鹿大道（南重庆的江南新城），江南新城作为南区发展的新格局，是集产业、政商、人居、商贸、旅游为一体的重点经济区域，江南新城包含长江以南的南岸区和巴南区二环以内的全部区域，占全市二环内面积的30%。也是离三大CBD最近的、资源最丰富的城市副中心，是重庆城市发展的三驾马车之一。拥有一环四隧三轨道的立体交通网络。内环快速干道突破南山天堑，真武山隧道连接南坪中心、南山隧道、慈母山隧道、鹿角隧道已经开通，轻松实现30分钟生活圈快速切换。项目引进美的巅峰科技5M智慧社区4.0系统，用户通过一个手机即可享受室外社区智能服务和室内智能生活操控。项目周边约1800亩五大主题公园环绕，涵盖了儿童公园、伊顿湖滨公园、维多利亚公园、体育公园、湖滨亲子公园，让生活自然而然；项目毗邻奥特莱斯、协信星光商业，让繁华触手可及；项目交通便捷，真武山隧道连接南坪 ，南山隧道、慈母山隧道通车，实现渝中区、江北区快速出行，规划中鹿角隧道接通杨家坪、大渡口区域，全面通车的轻轨6号线与项目周边规划中的轻轨8号线、轻轨12号线，形成四横三纵三轻轨的交通路网，即刻畅达全城；项目周边鱼洞试验二小 、清华中学 、树人小学、江南中学已落地呈现，0-16岁全龄教育体系全程无忧。', '2019-07-29 15:32:09', '81077bf5-898f-451d-89cc-1c1d1d27dfb5', '2019-07-30 10:40:19', '81077bf5-898f-451d-89cc-1c1d1d27dfb5', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
