INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('32A442A0-29E4-4892-97B2-C50DE0C48DD6', '云南省昆明市广福路与星耀路交叉口', '800706', 5201, 49, 840000, '800000', '2fed462c-f6a3-42bd-ae28-6e72655f9af1', '800700', 276000, 37, 5980, '2050-12-31 00:00:00', 521.0000, 37.3900, '俊发河畔俊园', '云南俊发物业服务有限公司', 4.5000, 5301, 40, 555, 2.3, '李峰', '18523577771', NULL, '一手商铺销售', '2018-12-01 00:00:00', '2019-04-07 00:00:00', '商铺', 40, 203, 163, 1, '2fed462c-f6a3-42bd-ae28-6e72655f9af1', '102.75187646438279', '24.947392230195803', NULL, '102.74541', '24.941322', 8.200000, 237.860000, '2019/2/32A442A0-29E4-4892-97B2-C50DE0C48DD6/DBC070AB-2CEF-4E1A-A9F4-CB8D01DFAABD_360_215_ICON_1.jpg', 8, NULL, '7b957770-7eb4-4e59-bdf1-2c4fa836f2d9', '2019-03-05 12:03:14', 8, '  俊发琥珀俊园（河畔俊园）是由1998年成立的云南第一房企俊发地产打造的品质小区。项目地处于整个昆明市区的南市区，官渡区政府和官渡古镇就在项目旁边，有便捷的交通和完善的配套。项目处在一个五横四纵的交通网络之中，五横包括云秀路、星耀路、珥季路、昌宏路以及飞虎大道，其中昌宏路与飞虎大道是贯穿了整个昆明市的东西区位的两条主干道，四纵包括彩云路、广福路、南绕城高速和环湖东路，这四条路与刚刚的五条路相互交叉，形成了一个网状交通，正在规划的古滇大道从项目经过。项目周边还拥有着丰富的教育资源，有14所优质中小学，项目本身有4所学校。周边配备医疗设施，项目北面有一所官渡云瑞医院属于一级综合医院，另外星耀路上的昆明市第一人民医院也是一所公立的大型综合“二级甲等”医院。', '2019-02-18 17:38:51', '946cddf4-065c-43a7-88d1-b2c39b024c4f', '2019-07-01 11:22:15', '3ea9739c-f445-4043-8c5e-bb654f987022', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('376399CF-2FE1-4E13-B5A5-2E9685022AE6', '重庆市渝北区礼嘉商务区华侨城云澜', '500312', 447, 24, 66400, '500000', 'd9659dee-10b6-4a07-96ab-c2647917c7a2', '500300', 38100, 30, 256, '2055-05-30 00:00:00', 151.8500, 74.1100, '华侨城云澜', '华侨城物业管理有限公司', 5.0000, NULL, 36, 85, 1.2, '洪中', '17782318679', 6.6400, '一手商铺销售', '2019-03-29 00:00:00', '2019-09-28 00:00:00', '住宅', 18, 31, 4, 1, NULL, '106.51860067923104', '29.68471799205414', NULL, '106.512012', '29.678971', 41.620000, 164.490000, '2019/4/376399CF-2FE1-4E13-B5A5-2E9685022AE6/5C426D8E-7C1C-4EE4-B6FD-157D45BA092A_360_215_ICON_1.jpg', 8, NULL, '3b58adf3-bb61-4215-9ca7-453e09365082', '2019-04-20 23:40:51', 8, '重庆华侨城是华侨城集团首度入渝打造的大型文化旅游综合项目，是集文化旅游、娱乐体验、生态休闲、主题商业、人文社区等多种业态于一体的综合项目。其中重庆欢乐谷是华侨城在国内的的第七座欢乐谷主题公园。景区包括“四园一带五中心”，分别是“欢乐谷公园、玛雅水乐园、生态教育展示公园、体育运动竞技公园”和“OCT滨江市民休闲带”以及“都市娱乐中心、城市庆典中心、体育竞技中心、生态教育中心、文化演艺中心”；华侨城重庆大型文化旅游综合项目将按照“四园、一带、五中心”的布局，规划建成集文化旅游、娱乐体验、生态休闲、主题商业、人文社区等多种业态于一体的大型文化旅游综合项目，打造重庆文化和旅游的标杆之作。', '2019-04-18 21:24:14', '946cddf4-065c-43a7-88d1-b2c39b024c4f', '2019-07-30 09:03:17', '946cddf4-065c-43a7-88d1-b2c39b024c4f', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
