INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('4BD861F2-DEBC-4D33-A452-685419F460F2', '重庆市南岸区南坪五公里学府大道（重庆工商大学兰花湖校区旁）', '500408', 1414, 36, 1350000, '500000', '9025972f-a9bb-4f20-89a8-730984367508', '500400', 450000, 30, 4600, '2043-12-31 00:00:00', 374.9400, 60.3100, '山千院', '康恒物业', 3.0000, NULL, 50, 168, 3, '罗中立', '18983374515', 45.0000, '一手商铺销售', '2019-01-14 00:00:00', '2020-01-31 00:00:00', '住宅', 61, 61, NULL, 1, NULL, '106.56989714583027', '29.50360734707807', NULL, '106.563502', '29.497298', 29.990000, 193.120000, '2019/1/4BD861F2-DEBC-4D33-A452-685419F460F2/A2CFCAAE-A90A-4418-8418-9472FCFE0AB3_360_215_ICON_1.jpg', 8, NULL, '3b58adf3-bb61-4215-9ca7-453e09365082', '2019-04-11 12:18:14', 8, '山千院东苑为45万方庭院洋房社区，位居南坪新南湖工商大学新校区旁，紧邻回龙湾成熟大社区。\n山千院东苑一期由原创庭院洋房、多维院落高层、200亩山地公园三部分组成，是新南湖乃至整个南坪中心少有的大型洋房社区。与兰花湖公园毗邻\n山千院坐拥新南湖成熟商业，周边农贸市场、超市一应俱全，医院、银行、餐饮、娱乐休闲等配套应有尽有。周边有幼儿园、珊瑚小学、巴蜀实验中学、重庆工商大学、重庆交通大学、重庆教育学院、重庆邮电大学等书香环绕。', '2019-01-16 16:56:59', '946cddf4-065c-43a7-88d1-b2c39b024c4f', '2019-07-14 18:06:48', '00d11ef7-7d32-4551-bd51-d8858db72611', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('4CBDD7F8-5829-47D6-AE23-A72A1CAB7F68', '重庆市九龙坡区兴堰路8号', '500614', 3925, 30, 720000, '500000', 'f7d61438-5dbf-4faa-b166-81dabd101711', '500600', 144000, 30, 5570, '2053-04-30 00:00:00', 79.0400, 79.0400, '北大资源燕南', '北大资源集团北京方诚物业经营管理有限公司', 2.2000, 4725, 40, 1856, 3.7, '伍筱寒', '13883967075', 72.0000, '一手商铺销售', '2018-10-12 00:00:00', '2018-12-31 00:00:00', '商铺', 1, 137, 2, 1, 'f7d61438-5dbf-4faa-b166-81dabd101711', '106.50518231217555', '29.49588067804388', NULL, '106.498613', '29.490205', 69.860000, 69.860000, '2018/12/4CBDD7F8-5829-47D6-AE23-A72A1CAB7F68/C6AE66D7-A503-4C33-A4D2-0433876B9DEF_360_215_ICON_1.jpg', 8, NULL, '3b58adf3-bb61-4215-9ca7-453e09365082', '2019-04-12 21:11:59', 8, '北大资源燕南位于杨家坪商圈与大渡口商圈交汇处，邻近轻轨二号线大堰村站，地处九龙坡区“退二进三”的发展版块，具有交通、地段、商业、品牌价值优势。随着重钢城市风景区的落成，也将带动项目的发展。 北大资源燕南总建筑面积约72万方，是集高层、洋房、邻里型商业多重业态的综合性人居文化生活城。', '2018-12-04 17:43:46', '946cddf4-065c-43a7-88d1-b2c39b024c4f', '2019-07-10 11:50:05', '00d11ef7-7d32-4551-bd51-d8858db72611', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('511cfdb0-fadd-476b-816e-2ea8af3cc199', '重庆市渝北区回兴兴科大道与宝桐路交汇处', '500305', 1802, 6, 260000, '500000', '9813c01a-29ec-4992-890b-633577ed0da9', '500300', 43000, 30, 1149, '2065-12-29 00:00:00', 12000.0000, 0.0000, '蘭亭新都汇', '重庆市银翔物业管理有限公司', 22.0000, NULL, 50, 237, 4, '石海波', '13628355858', 4.2600, '一手商铺销售', '2019-08-01 00:00:00', '2019-10-31 00:00:00', '商办项目', NULL, NULL, NULL, 1, NULL, '106.60815518567641', '29.69490784776307', NULL, '106.601594', '29.689088', NULL, NULL, '2019/8/511cfdb0-fadd-476b-816e-2ea8af3cc199/823fac08-c4d3-4180-8ffd-87a51359f9be_360_215_ICON_1.jpg', 8, '2019-08-16 11:48:45', '3b58adf3-bb61-4215-9ca7-453e09365082', '2019-09-16 11:48:45', 0, '蘭亭.新都汇，占地约63亩， 总建筑体量约27万㎡。地处宝桐路与兴科大道交汇点，区位优势明显。产品设计涵盖建面60-90㎡小户高层，建面30-60㎡高回报投资型产品；住宅公共部分装修以星级酒店标准打造，携手国际一线智能家居品牌共同打造“生活+”智能生活方式，联合国际一线物业公司为业主提供“服务+”品质生活服务。自持10万㎡集中商业，立足核心咽喉要道，以“渝北商业中心”为打造目标，树立渝北商业新形象，引领渝北商业新风尚。目前，约6000㎡重庆首个“IMAX+双巨幕”配置金逸国际影城、约3000㎡全国知名健康产业连锁品牌--海派健身、约15000㎡目前渝北大国际品牌生活超市、3000㎡连锁大型宴会厅等均已签约入驻。', '2019-08-16 17:29:55', '81077bf5-898f-451d-89cc-1c1d1d27dfb5', '2019-09-16 09:40:21', '81077bf5-898f-451d-89cc-1c1d1d27dfb5', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('52c60f4a-8ce8-4f13-90c0-392153fb41d6', '长滨路136号', '500104', NULL, 2, 48822, '500000', '0333008a-592b-41a8-a93b-87e2783653db', '500100', 5706, 25, 750, '2047-06-01 00:00:00', 342.0200, 156.6200, '大唐诺亚', '世联雅园', 12.0000, NULL, 40, 27, 8.6, '刘总', '17708333090', 4.8800, '一手商铺销售', '2019-06-11 00:00:00', '2019-12-31 00:00:00', '住宅', 15, 16, 1, 1, NULL, '106.58940404629786', '29.558180193806873', NULL, '106.582917', '29.552059', 32.750000, 97.060000, '2019/7/52c60f4a-8ce8-4f13-90c0-392153fb41d6/b7c66699-f8eb-4355-8416-328ef7843b93_360_215_ICON_1.jpg', 8, NULL, '3b58adf3-bb61-4215-9ca7-453e09365082', '2019-07-16 11:42:44', 8, '大唐地产——福信集团旗下地产业务的核心平台与核心品牌。公司源自台湾、兴于厦门、深耕大陆，自20世纪80年代从事房地产开发，迄今二十余载。公司是房地产开发国家一级资质企业，曾荣膺台湾建筑界最高奖“鲁班奖”和“国家建设部优秀建筑设计奖”为代表的诸多荣誉，二十多年来，公司以独特的建筑理念和极具个性的品牌形象，赢得了广泛的市场知名度与品牌美誉度。2010年，公司与福信集团旗下另一地产开发平台——信地集团的住宅业务优化整合，构建北方、西南、东南三大区域中心，运行总部、区域、城市公司三级管控架构，初步形成全国化战略布局的大型地产集团。\n大唐诺亚比邻时尚地标解放碑、夜生活主场较场口、未来新兴商务区朝天门；亦可以畅游历史风貌旅游区--巴县衙门、抗蒙帅府遗址公园、汪泰全商号、蒋介石行营、湖广会馆等，尽享解放碑CBD成熟配套和渝中母城历史文脉，现代与传统，在不经意间自由切换。\n在居住之外，江岸、码头、游艇，构成了高级经理人生活的另一面，大唐诺亚专设12m宽的景观步道及地下遂道直通长江岸边，倾力打造业主尊享游艇码头及1000余平米水上会所--大唐方舟，举杯邀月，对酒当歌，揽尽一城风流。', '2019-07-16 11:28:59', '00d11ef7-7d32-4551-bd51-d8858db72611', '2019-07-18 10:40:39', '946cddf4-065c-43a7-88d1-b2c39b024c4f', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('53139613-e3b3-472b-89c7-077449092e2f', '重庆市渝北区甘悦大道中央公园正南门', '500320', 4600, 74, 600000, '500000', '4a005e9b-5150-4961-bf77-5b8efdc04593', '500300', 158000, 35, 3737, '2057-06-30 00:00:00', 103.4500, 48.4600, '金辉中央铭著', '重庆金辉锦江物业服务有限公司', 3.5000, 4640, 40, 622, 2.8, '李阳', '13389647893', 44.0000, '一手公寓销售', '2019-05-11 00:00:00', '2019-06-30 00:00:00', '公寓', 443, 622, 172, 1, '4a005e9b-5150-4961-bf77-5b8efdc04593', '106.58931597776423', '29.7102559831228', NULL, '106.582853', '29.70414', 34.870000, 65.580000, '2019/5/53139613-e3b3-472b-89c7-077449092e2f/d7f7fe76-e1bb-46f5-bec0-0b1e98334489_360_215_ICON_1.jpg', 8, NULL, '3b58adf3-bb61-4215-9ca7-453e09365082', '2019-05-07 12:59:56', 8, '1、生态公园：金辉·中央铭著紧邻的中央公园，是政府斥巨资建设的亚洲第一大城市公园。园内树林茂密，四季郁郁葱葱，同时配有生活休闲乐趣、充满鲜氧的公共空间，堪称重庆地标。凭借优越地势，金辉·中央铭著成为出入公园最便捷、观景角度最佳的府邸。居住于此，进退百米即可观湖赏花、晨练健身、修身养性，私享“园味”生活。2、超低容积率：城市别墅，贵在自然。中央公园别墅，以0.84的超低容积率，使每户尽享私密品质生活，把亲密还给自然，把从容和舒适还给生活。而当低密别墅遇上生态公园，更成就一处可遇不可求的臻稀生活大境。3、匠心精筑：内外皆园景，让生活的每一帧都如诗如画！金辉·中央铭著携匠心精筑之情怀，以提高人居的生活品质为理念，公园自然风光与诗意园林成就大美之境，不仅满足了回归自然的需求，更是实实在在的生活进阶！', '2019-05-07 11:41:00', '00d11ef7-7d32-4551-bd51-d8858db72611', '2019-07-01 10:15:21', '00d11ef7-7d32-4551-bd51-d8858db72611', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('53891BBF-2848-405B-9280-36F27659C4C0', '重庆市巴南区龙泽路808号', '500703', 2774, 58, 305000, '500000', '0e2ece82-66ce-44bb-90a1-465dc4c73b0e', '500700', 286000, 30, 3000, '2067-05-30 00:00:00', 392.0300, 53.3300, '荣盛锦绣南山', '荣盛物业', 5.0000, 2787, 50, 75, 3.6, '牛博', '18523929969', 30.5000, '一手商铺销售', '2018-11-07 03:03:32', '2019-02-05 03:03:32', '住宅', 73, 75, 2, 1, NULL, NULL, NULL, NULL, NULL, NULL, 34.490000, 166.150000, '2019/1/53891BBF-2848-405B-9280-36F27659C4C0/71B64980-A0A1-46A1-B09C-14AECF6FC336_360_215_ICON_1.jpg', 8, NULL, '3b58adf3-bb61-4215-9ca7-453e09365082', '2019-01-14 15:52:01', 8, '锦绣南山是荣盛发展入渝打造的首个标杆高端品质社区。总占地208亩，体量30.5万方，项目分为A、B、C、 D四个组团来打造。业态丰富：洋房、别墅、高层、商业，其中商业比例仅占10%，3万方，足够保障社区的生活配套又不影响居住品质。其周边政府、银行、商业、医疗、教育、文化娱乐、主题公园集聚，项目形成8分钟完美城市生活圈。', '2019-01-14 11:22:59', '946cddf4-065c-43a7-88d1-b2c39b024c4f', '2019-01-16 18:44:34', '', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('540ba28e-5bf1-4075-b696-dda179363f91', '昆明市西山区福海街', '800906', NULL, 12, 800, '800000', '2fed462c-f6a3-42bd-ae28-6e72655f9af1', '800900', 1000, NULL, 300, '2050-01-01 00:00:00', 12000.0000, 0.0000, '光明测试大厦', '彩云之南物业', 1200.0000, NULL, 50, 120, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '住宅', NULL, NULL, NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019/3/540ba28e-5bf1-4075-b696-dda179363f91/82ad90c8-bc17-47f2-9691-599a7447c386_360_215_ICON_1.jpg', 8, NULL, '7b957770-7eb4-4e59-bdf1-2c4fa836f2d9', '2019-03-04 18:48:22', 24, '看几何冲刺', '2019-03-04 18:34:50', '2bdd7297-325b-49f7-8858-7b392c3003b8', '2019-03-04 21:48:16', '', '2019-06-29 00:52:32', 'admin', 1, '|商铺|写字楼|车库|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('56d5839a-cc10-48da-addb-b1bde396060c', '成都市双流区东升街道航都大街四段111号', '600707', NULL, 14, 202193, '600000', '62e88fad-c4a0-4b8e-bb14-a770e2c71593', '600700', 48800, 30, 1386, '2056-12-01 00:00:00', 620.4700, 55.3100, '景茂誉府景悦里', '四川景灿物业有限公司', 3.0000, NULL, 40, 272, 3.2, '万军良', '13666226967', 20.2200, '', '2019-04-01 00:00:00', '2020-03-31 00:00:00', '商办项目', 51, 51, 0, 1, '62e88fad-c4a0-4b8e-bb14-a770e2c71593', '103.918021', '30.596498', NULL, '103.911613', '30.590219', 48.660000, 485.290000, '2019/6/56d5839a-cc10-48da-addb-b1bde396060c/725647b0-33bf-41fa-b179-bd3afb0391a0_360_215_ICON_1.jpg', 8, NULL, 'bdee5fe4-6259-4556-83a3-b3501f19ae71', '2019-07-02 16:51:53', 8, '景茂景悦里项目是由景茂集团投资，四川鑫龙实业发展有限公司开发打造的全新情景式商业街，24小时品质消费目的地，项目位于双流新城板块核心区域。双流新城板块地处成都走廊式发展的主动脉上，为整个大成都的南部财富新城，目前整个区域常住人口超10万人，已成为集交通、商业、医疗、教育于一体的高度便捷的高品质居住区、商业商务核心区，政府已在该区域成功引进万达广场、海滨城、优品道广场、时代奥特莱斯等，并着力打造亚洲最大的8500亩生态湿地公园。', '2019-06-27 16:03:13', '3504c3c4-fd4d-4503-9628-ab2e3d781294', '2019-07-02 16:51:53', '3504c3c4-fd4d-4503-9628-ab2e3d781294', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('5B28156E-C005-402C-B863-AA3225C09764', '四川省成都市双流区西航港新街799号', '600708', 899, 8, 93650, '600000', '4d9d5349-f913-4c6a-b27f-e6f1150e5ddf', '600700', 34802, 35, 1024, '2054-07-01 00:00:00', 1991.3500, 298.4300, '景茂雍水岸郦府', '四川省景灿物业服务有限公司', 3.0000, NULL, 70, 106, 3, '喻洋', '13551348626', 13.5800, NULL, NULL, NULL, '住宅', 21, 21, NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, 71.480000, 437.690000, '2019/3/5B28156E-C005-402C-B863-AA3225C09764/60B7752D-7D70-494A-A927-8D5B21005A63_360_215_ICON_1.jpg', 8, NULL, 'bdee5fe4-6259-4556-83a3-b3501f19ae71', '2019-04-24 10:35:03', 8, '尊踞大源西核心，凭借其地理、环境、交通、品质等市场优势，成为大源西的门户大盘。多个高端别墅沿河而建，区域价值不言而喻。景茂·雍水岸于26万平米江安原生河畔之上，3公里天成河岸旁，拥抱400亩原生山林，天成生态可媲美别墅。其依附在4000亩百年川大旁，人文与山水一脉，真实的演绎了现代都市人居品质生活。\n    景茂·雍水岸，以舒适的人居环境为打造理念，大围合布局，收揽约15000m阔景中庭，缔造200米极致楼间距，浩瀚视野傲然天成。采用ART-DECO建筑美学，完美塑造双低密建筑华居。一站式商业配套，即步可享闹事繁华，奢阔赠送，拓展更多尺度，真正的做到品质与价格兼顾的臻品华居。', '2019-03-27 17:32:24', '946cddf4-065c-43a7-88d1-b2c39b024c4f', '2019-04-24 10:35:03', '946cddf4-065c-43a7-88d1-b2c39b024c4f', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('5b629a3c-69d8-4247-9e80-6f6bdee98bff', '郑州郑港六路与郑港七街交叉口东南角', '1001301', 2631, 34, 415000, '1000000', '6661b044-0f7b-4310-9210-47ffe65a4f5c', '1001300', 120000, 35, 2425, '2083-05-20 00:00:00', 1059.3900, 89.3900, '安纳西庄园', '招商局物业管理有限公司', 5.0000, 2740, 70, 31, 2.5, '绍永波', '13598093715', 41.5000, '一手商铺销售', NULL, NULL, '住宅', 29, 29, 0, 1, NULL, '113.87973797912339', '34.57289509755675', NULL, '113.873328', '34.566573', 43.960000, 402.520000, '2019/9/5b629a3c-69d8-4247-9e80-6f6bdee98bff/3f893a75-1bce-4dd3-bf8d-f28433689e86_360_215_ICON_1.jpg', 8, '2019-08-29 14:34:54', '0170817f-902e-42e6-8ab1-7e8a126ddd0a', '2019-09-11 15:24:52', 8, '安纳西庄园项目位于港区西北方位的“都市级商业中心”，另外港区机场附近两个“城市级商业中心”，空港南部商业中心和空港东部商业中心；港区交通便利，自贸区批复带来的是无限商机，航空港目前商业布局是按照商业中心与社区级行业中心相结合的形式。我们社区的底商就可以满足您的日常所需，生鲜超市、理发店、早餐店出门就是除了比较成熟的沃金商业街、爱购超市等，最新建成并开业的大型商业中心锦荣悦汇城，离我们项目1千米左右，可以说是目前港区最大的商业中心，集休闲，购物，餐饮美食，健身等一应俱全，里面全新的奥斯卡影城更是您周末的好去处。', '2019-09-11 10:15:05', 'e2752883-77bc-4eea-951d-d44756e21a95', '2019-09-29 14:34:54', 'e2752883-77bc-4eea-951d-d44756e21a95', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
