INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('5E1F268A-9133-4EFA-A13E-FD75EF056C6E', '云南省昆明市官渡区通河街区云大附属会展学校东侧', '800711', 285, 1, 41573, '800000', 'c03b30dd-1ce1-4bf6-9f31-9ca673598c0b', '800700', 14887, 30, 805, '2055-05-30 00:00:00', 134.9700, 77.8200, '龙湖听蓝半岛', '龙湖物业', 6.0000, 1000, 40, 159, 2.4, '张超伟', '15025555469', 4.1600, '一手商铺销售', '2019-04-24 00:00:00', '2019-05-31 00:00:00', '商铺', 8, 10, 2, 1, 'c03b30dd-1ce1-4bf6-9f31-9ca673598c0b', '102.7076305822738', '24.941018326422565', NULL, '102.701191', '24.934853', 18.300000, 38.790000, '2019/4/5E1F268A-9133-4EFA-A13E-FD75EF056C6E/6B47B711-93C5-42B5-AD32-26B2C333F218_360_215_ICON_1.jpg', 8, NULL, '7b957770-7eb4-4e59-bdf1-2c4fa836f2d9', '2019-04-29 10:53:04', 8, '龙湖听蓝半岛，龙湖入昆第二号作品。占据滇池半岛-国际会展经济圈核心区位，距离滇池直线距离约800余米，距滇池国际会展中心约1公里米，距地铁2号线、5号线换乘站会展中心站（建设中）约1公里。项目拥览滇池海景，以全成品观湖寓的产品形态，填补区域同类产品空白。兼具滇池自然生态资源和国际会展城市配套的双重价值，是不可多得的城市滨湖资产。', '2019-04-27 17:14:30', '946cddf4-065c-43a7-88d1-b2c39b024c4f', '2019-07-01 11:22:03', '3ea9739c-f445-4043-8c5e-bb654f987022', NULL, NULL, 0, '|车库|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('5e592f41-8722-4c6a-9c1c-6d6003dee5ce', '昆明市西山区人民西路与环城西路交汇处', '800903', 2366, 2, 427000, '800000', 'fee64052-b958-4043-ab62-a5dd0a633935', '800900', 5484501, 30, 1228, '2056-12-31 00:00:00', 449.5800, 8.1600, '北大资源博泰城', '北京北大资源物业经营管理集团有限公司昆明分公司						', 5.0000, NULL, 40, 140, 4.6, '杨大春', '15287164245', 10.8000, '一手商铺销售', '2019-09-08 00:00:00', '2019-12-31 00:00:00', '商铺', 140, 140, 0, 1, NULL, '102.6954877711797', '25.047166569855325', NULL, '102.689001', '25.041187', 6.800000, 127.900000, '2019/9/5e592f41-8722-4c6a-9c1c-6d6003dee5ce/045adaa9-00b1-4977-b3b4-6f29cfe0da8d_360_215_ICON_1.jpg', 8, '2019-08-11 15:37:55', '7b957770-7eb4-4e59-bdf1-2c4fa836f2d9', '2019-09-09 16:29:12', 8, '北大资源博泰城由品牌开发商开发，位于昆明市西山区，紧邻昆明市环城西路，是区域内具商业价值的地块。项目与各交通节点的距离均处于可接受范围，整体交通通达性较好，城市东西主干道（人民西路）与城市快速通道（环城西路）交汇，快速通达全城，覆盖全城的交通体系，约15条公交干线经过，快速通达全城各区域，地铁上盖物业，3号线市体育站地铁口无缝接驳。此外，项目的配套丰富全面，不仅有丰富的周边配套，如学校、医院、公园、金融等，而且项目自身带有商业，让住户有了更方便的购物条件。整个项目涵盖6栋住宅、2栋公寓、1栋写字楼以及一个商业MALL，项目建成后将是一个集精品百货、商务空间、服务型公寓、高档精装住宅等多元化元素为一体的大型城市综合体。 同时通过集团特有文化背景及资源整合能力，将住宅、公寓、写字楼融合成一个集文化、艺术、体验，强调分享、互动的场所，将项目打造成为昆明中央商业文化商业体验区。', '2019-09-09 13:34:55', '4e28e0ad-67de-4be3-955a-7bc83c7f43ca', '2019-09-11 15:37:55', '4e28e0ad-67de-4be3-955a-7bc83c7f43ca', NULL, NULL, 0, '|商铺|车库|公寓|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('5f7d9ede-4f4f-49ca-8cb0-bb6d57edb11a', '成华区昭觉寺横路10号', '600518', NULL, 13, 570000, '600000', 'e67fbd46-51ec-4da9-84ba-39cb97572abe', '600500', 74000, NULL, 3795, '2055-01-01 00:00:00', 98.6600, 59.3000, '泛悦城市广场', '中国电建地产成都分公司', 4.0000, NULL, 40, 52, NULL, '丁艳', '13982258540', 57.0000, '一手公寓销售', '2019-05-24 00:00:00', '2019-09-30 00:00:00', '商办项目', 52, 52, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, 40.980000, 72.040000, '2019/6/5f7d9ede-4f4f-49ca-8cb0-bb6d57edb11a/bbf3c781-00a5-4ac2-8ba3-922a0b64ecad_360_215_ICON_1.jpg', 8, NULL, 'bdee5fe4-6259-4556-83a3-b3501f19ae71', '2019-06-17 11:37:26', 8, '泛悦城市广场由世界500强功勋央企电建地产和21年商业开发运营专家南国置业联手投资打造，项目位于成都市成华区昭觉寺以南，东至昭觉寺横街(2.5环)；南至规划道路，与“北回归线一期”、“富丽锦城”等项目相邻；西至川陕路(规划为驷马桥街)；北至圣路易医院，为国家二级甲等综合医院；西南紧邻地铁三号线的驷马桥站，交通十分便利。\n泛悦城市广场是地铁入户综合体，缔造成都北中心TOD地标，集时尚购物中心、体验式商业街区、独栋商业、智慧公寓、智能华宅全业态于一体。', '2019-06-17 10:46:57', '3504c3c4-fd4d-4503-9628-ab2e3d781294', '2019-06-17 11:37:26', '3504c3c4-fd4d-4503-9628-ab2e3d781294', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
