INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('6b3e21bd-91da-47f1-a139-02f5c0299180', '重庆市江北区盘溪路', '500214', NULL, NULL, 20000, '500000', NULL, '500200', NULL, NULL, NULL, NULL, 12000.0000, 0.0000, '两江春城', '', NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, '106.49425750298455', '29.603656160160885', NULL, NULL, NULL, NULL, NULL, '2019/9/6b3e21bd-91da-47f1-a139-02f5c0299180/74e3334a-c52f-47d3-a170-d4189b8388ff_360_215_ICON_1.jpg', 0, NULL, '3b58adf3-bb61-4215-9ca7-453e09365082', NULL, 0, '两江春城总占地860亩，总建筑面积115万方，容积率仅为2.45，是难得一见的地处黄金地段且拥有双公园的低密度生态大盘，宜居资源绝佳，物业形态集聚了纯板式洋房、坡地别墅、阔景高层、精装SOHO、超五星级酒店、国际甲级写字楼、大型商业中心和格调风情步行街。项目右揽新牌坊、左拥冉家坝，地段价值无可比拟。经石子山立交和北环立交无缝接驳内环快速路，直通江北国际机场，快速畅达主城各大区域；项目内设轨道交通环线体育公园站，距轨道交通5号、6号和环线换乘枢纽冉家坝站仅200米，周边四大公交站点，已开通30余条公交线路，公共交通发达；观音桥、新牌坊等6大商圈环伺，自有50万方商务商业集群，其中9万方五星级酒店，50层268米高区域地标性建筑，互补10万方源著天街，商业价值不可限量，乐享繁华配套；九大公园环绕，零距离江北体育公园（投资4亿、占地320亩）、项目内设两江春城公园（投资2亿、占地130亩），轻松享受生态、低碳有氧生活。', '2019-09-26 17:48:17', '81077bf5-898f-451d-89cc-1c1d1d27dfb5', '2019-09-27 10:31:18', '81077bf5-898f-451d-89cc-1c1d1d27dfb5', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('6e366225-928e-49d8-bd07-c2462c63bec1', '重庆市沙坪坝区景阳路26号', '500502', 456, NULL, 354300, '500000', NULL, '500500', 112205, 30, NULL, NULL, 12000.0000, 0.0000, '贝蒙天地', '', 3.5000, NULL, NULL, NULL, 2.5, '', NULL, NULL, '一手商铺销售', '2019-09-11 00:00:00', '2019-10-10 00:00:00', NULL, NULL, NULL, NULL, 1, NULL, '106.32239072846417', '29.59986381946502', NULL, NULL, NULL, NULL, NULL, '2019/9/6e366225-928e-49d8-bd07-c2462c63bec1/eb17955b-f404-4c25-997c-cc6fb0743aad_360_215_ICON_1.jpg', 0, NULL, '3b58adf3-bb61-4215-9ca7-453e09365082', NULL, 0, '贝蒙天地共分为两期开发，预计在3-5年建设完成，一期以别墅区域为主，后期主要以小高层、高层为主。4000㎡森态绿庭，典藏四季的风景一步一景，疏密有致，贝蒙致力打造精致与休闲相结合的生活状态。五大主题庭院与五大主题景观，主体水景与各处小雕像、柱廊、草坪等建筑小品交相辉映。丰富景观空间序列和秩序与建筑完美融合，淋漓演绎贝蒙的创新与精致。独享乔木与灌木想结合组成精致化的植物造景，特型花乔及观赏性强的植物，与建筑整体风格相契合，给人一种赏心悦目、玲珑精致的视觉效果，足不出户就能观赏到各种精致的景色。出则繁华、入则自然:公交地铁一号线10月开通，双碑大桥和双碑大道明年年初通车，到达市区新牌坊直达市中心20~30分钟，项目通过璧山隧道直达璧山区仅需5-10分钟，外环以南西永保税港快速链接成渝高速，北碚，渝武高速等。领略一座城市的奢雅:秉承贝蒙置地\"创新\"手法，新古典主跨界相容义的建筑气质与现代的建筑跨界相融，打造出兼具优雅与力感的新古典主义美学建筑。丰富饱满的建筑立面、科学创新的施工工艺，充分领略贝蒙制造的奢华和舒适。至善配套:献上顶级生活犒赏:贝蒙天地专属尊贵社区空间，600平米豪华景观泳池，多组合体育配套篮球场、乒乓球场以及羽毛球场等健身设施，给生活一个运动空间，欣、畅、知、容等七大休闲园林，感知无限延展的休闲空间。贴心礼遇，智慧住宅升级故事人生:智能安防，层层守护名流私属地，划分阶层的领地，在名流专属的生活场里享受科技宠爱，封闭式物业管理及多重智能安防系统(可视对讲系统、电子指纹密码锁、红外探测等)，让日常生活不受侵犯，科技解码实现智能生活的最佳礼遇。', '2019-09-18 10:31:09', '81077bf5-898f-451d-89cc-1c1d1d27dfb5', '2019-09-18 12:38:16', '81077bf5-898f-451d-89cc-1c1d1d27dfb5', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('6E8FE0FC-65ED-4FA4-BA30-5B405F95E4E2', '重庆市大渡口区金中大道与新郭伏路交汇处', '500811', NULL, 37, 1180000, '500000', '3914b49c-7e79-4374-b2cb-ec4d6b7de298', '500800', 506667, 33, NULL, '2067-11-21 00:00:00', 229.2500, 121.6700, '荣盛城', '廊坊荣盛物业服务有限公司', 5.0000, NULL, 50, 170, 2.3, '宋永超', '15826139279', 118.0000, '一手商铺销售', '2018-11-16 06:07:18', '2019-01-16 06:07:18', '住宅', 9, 39, 9, 1, NULL, NULL, NULL, NULL, NULL, NULL, 64.100000, 126.670000, '2019/1/6E8FE0FC-65ED-4FA4-BA30-5B405F95E4E2/E19E0C16-7EE1-47C0-AC6F-AF3A2142A551_360_215_ICON_1.jpg', 8, NULL, '3b58adf3-bb61-4215-9ca7-453e09365082', '2019-01-11 14:40:45', 8, '荣盛城118万方超规格国际化城市巨擘，占地760亩，共有21块宗地组成，综合容积率约为2.3，部分组团容积率低至1.2，是一座低密度、高品质的大型生态组团。荣盛城位于大渡口八桥组团的核心位置，优享政策利好，鼎力大渡口国际化大都市进程；占据优越的地理位置，经内环高速与重庆西站快速对接，近享轻轨2/5号线，经西城大道、华福大道、金建路、华福二路四条城市主干道，串联整个城市的交通；大渡口中医院和大渡口人民医院就在旁边，驱车直达新桥医院和西南医院；自建20万方风情商业，毗邻万达广场和九宫庙商圈。享国家一级物管资质的荣盛物业。', '2019-01-11 14:31:31', '946cddf4-065c-43a7-88d1-b2c39b024c4f', '2019-04-03 19:54:53', '', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('72857822-2770-40c3-9dd2-36f10f4e7b4d', '重庆市渝北区金渝大道华侨城华悦中心', '500312', 2640, 5, 378689, '500000', 'd9659dee-10b6-4a07-96ab-c2647917c7a2', '500300', 70360, 30, 1299, '2053-06-02 00:00:00', 145.4000, 63.0400, '华侨城天际湾', '华侨城物业管理有限公司', 7.0000, NULL, 40, 56, 3.9, '洪中', '17782318679', 37.0000, '一手商铺销售', NULL, NULL, '商铺', 13, 31, 2, 1, NULL, '106.518879', '29.674287', NULL, '106.512289', '29.668536', 56.630000, 84.870000, '2019/5/72857822-2770-40c3-9dd2-36f10f4e7b4d/5c0d7898-631f-4c7b-911e-6dc55634770b_360_215_ICON_1.jpg', 8, NULL, '3b58adf3-bb61-4215-9ca7-453e09365082', '2019-05-15 10:14:55', 8, '重庆华侨城，深圳华侨城之后的第二规模造城，4平方公里生态创想城区中，以旅游+地产的开发模式，建设一座人文与艺术并重，自然与繁华兼得的城区，成为数万高端消费力的生活主场。\n2017年，全国首座山地版欢乐谷、启幕亲水娱乐新模式的玛雅海滩水公园（在建）将双园齐开，配合多轨道交通、多公交站点、三立交、三隧道、二桥及三纵二横主干道所构筑的立体交通路网，必将聚引全城人潮，成为重庆全新的消费热土。\n约9万方华侨城艺术商业，2017年重庆华侨城战略级产品：双地铁站口商铺，近拥来自全城的无限消费力；创新5.1m层高loft、多变SOHO公寓，注入华侨城创想理念，随心满足多种商业功能需求，开创城市全新商业模式。华悦中心，以其不可复制的区位与限量的席位，奠定未来的价值生长。', '2019-05-15 10:04:30', '00d11ef7-7d32-4551-bd51-d8858db72611', '2019-07-30 09:03:33', '946cddf4-065c-43a7-88d1-b2c39b024c4f', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
