INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('75720ea9-3ddc-4d06-a52f-639c42a5fe0b', '发热', '500101', 21321, 3242, 324, '500000', NULL, '500100', 3423, 43, 2312, '2019-10-29 03:12:32', 12000.0000, 0.0000, '测试楼盘新增', 'v大哥v从', 4.0000, 32432, 334, NULL, 34, '比分定格', '13366669999', NULL, '割让给法国不方便', '2019-10-29 03:12:38', '2019-11-06 03:12:40', NULL, NULL, NULL, NULL, 1, NULL, '106.57463064863143', '29.580641041284025', NULL, '106.568206', '29.574348', NULL, NULL, '2019/10/75720ea9-3ddc-4d06-a52f-639c42a5fe0b/3bf45c7d-af78-44ea-a976-35a9a37fce3c_360_215_ICON_1.jpg', 1, '2019-09-29 11:11:18', '0170817f-902e-42e6-8ab1-7e8a126ddd0a', NULL, 0, 'v方法广泛大锅饭分别发给', '2019-10-29 11:11:14', '1da134bd-82c2-4268-ab5d-a66c0cf763f2', NULL, NULL, NULL, NULL, 0, '|商铺|', '让外人', 3424, NULL, 2.0000, NULL, NULL, NULL, NULL, NULL, NULL, '|医院|学校|公交|地铁|银行|娱乐|购物|餐饮|', NULL, NULL);
INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('7a284bdb-ae8c-4e74-af8d-246782ebd537', '四川省成都市双流区东升街道商都路619号', '600707', 1345, 10, 132314, '600000', '0a2c691b-91f8-4316-899c-598cf4186a47', '600700', 50683, 22, 1447, '2053-04-17 00:00:00', 385.8400, 65.4000, '景茂名都东郡', '四川省景灿物业服务有限公司', 3.0000, 1345, 70, 70, 2.77, '喻洋', '13551348626', 20.0000, '一手商铺销售', NULL, NULL, '住宅', 11, 11, NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, 29.310000, 284.560000, '2019/3/7a284bdb-ae8c-4e74-af8d-246782ebd537/553968c2-e189-4028-b912-92c5ecb97eee_360_215_ICON_1.jpg', 8, NULL, 'bdee5fe4-6259-4556-83a3-b3501f19ae71', '2019-04-24 10:40:36', 8, '    景茂名都东郡位于新双楠核心，新双楠毗邻双流机场，衔接国际城南，交通发达，距地铁3号线仅700米，可高速直达春煕路、天府广场；周边813路、806路、802路等近十条公交畅达全城。项目位于奥特莱斯购物中心旁，举步直达旗舰级体验式商业地标美国城、海滨购物中心，与国际一线品牌零距离，繁华生活自此开始。\n     景茂名都东郡拥有完善教育体系，双流实验幼儿园、宝贝之家幼儿园、双流实验小学、东升小学、棠湖中学、东升一中等多所国重学府全力支撑。项目斥巨资打造区域低密品质生活之冠，约15,000m阔景双中庭，总面积堪比四个足球场；最大280米楼间距，大围合社区布局，建筑密度区域最低；意大利皇家园林风范，中轴景观带来极致体验，尽享低密度、高品质的优雅生活。重金打造区域唯一超豪华无边际泳池，超千平米的无边际会所级泳池，包含儿童池、成人池、按摩池，非普通泳池配置可比拟，开阔视野超高成本，问鼎配套之冠。景茂名都东郡以创新理念引领建筑革命，以不凡气度和财力带来首屈一指的尊贵体验。', '2019-03-27 17:21:07', '00d11ef7-7d32-4551-bd51-d8858db72611', '2019-04-24 10:40:36', '946cddf4-065c-43a7-88d1-b2c39b024c4f', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
