INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('871DD3BC-FD52-4933-A5E9-EAC76034B1DD', '江苏省南京市建邺区江心洲生态科技岛主轴中新大道与星月街交叉口', '700406', NULL, 8, 42000, '700000', '55c0e860-19cd-44ab-969a-b026904edc62', '700400', 28000, 30, 100, '2054-02-13 00:00:00', 596.2300, 251.0500, '升龙公园道', '绿城物业', 10.0000, NULL, 40, 100, 1.5, '芮之', '18180208806', 6.4000, '一手商铺销售', '2019-05-05 00:00:00', '2019-11-05 00:00:00', '商办项目', 11, 12, 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, 37.570000, 112.410000, '2019/5/871DD3BC-FD52-4933-A5E9-EAC76034B1DD/5EF72CF2-21FD-4B9C-87E5-790D3D081E7A_360_215_ICON_1.jpg', 8, NULL, '76145e5c-08f5-4621-b526-5af123636420', '2019-05-16 14:33:34', 8, '升龙公园道位居长江主城岛江心洲建邺江心洲夹江大桥与葡园路交汇处。区域内建设21公顷南部湿地公园、65公顷青奥森林公园、1.8万㎡生态会所等，绿化率达75%以上。项目紧邻2条地铁（地铁10号线、4号线）、9座游艇码头，4条步行桥、4条机动车道，10分钟畅达市中心。打造岛屿北部的社区文体中心，引入品牌幼儿园，岛区规划8所国际学校，享受优质的国际教育。项目建筑规划有住宅：花园洋房（6+1层），生态科技洋房（9-11层），联排别墅，叠加别墅，4万方商业中心，物业类型丰富。本案规划建设8栋2层街区商业及沿7栋北侧、3栋南侧的项目水系带的-1F下沉式酒吧街。', '2019-05-16 14:02:41', '946cddf4-065c-43a7-88d1-b2c39b024c4f', '2019-06-12 09:16:45', '7a5db1ea-828c-4c9a-9758-188a9a113776', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
