INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('8c9831fa-3dea-4576-ace6-fc1692bc0853', '渝北区奥特莱斯旁', '500314', 1500, 3, 205000, '500000', '151649e8-bd6c-44a4-944a-785f19c73111', '500300', 41286, 15, 420, '2056-07-29 00:00:00', 316.0200, 64.0400, '两江中迪广场', '四川港联华茂', 13.0000, NULL, 40, 101, 2.5, '李欣', '13996080447', 4.1200, '一手商铺销售', '2019-07-25 00:00:00', '2019-12-31 00:00:00', '商办项目', 101, 101, 0, 1, NULL, '106.5751540463367', '29.634384623307348', NULL, '106.568745', '29.6281', 31.140000, 186.440000, '2019/7/8c9831fa-3dea-4576-ace6-fc1692bc0853/6b1677fb-f493-4e4f-b5f2-8cca93f3b573_360_215_ICON_1.jpg', 8, NULL, '3b58adf3-bb61-4215-9ca7-453e09365082', '2019-07-26 11:50:21', 8, '两江中迪广场雄踞宜奥商圈核心，坐拥北重庆300万高端消费人群，以全新商业模式，启幕宜奥商圈新时代，创变重庆商圈新格局。\n项目投资约20亿元，建筑规模20万平方米，项目通过时尚、艺术建筑外观，半开放式空间，层层退台、多中庭回形动线设计，打造多主题情景式商业空间。现万达影院、永辉超市（绿标）、威尔士健身、万达宝贝王已签约进驻。\n两江中迪广场项目打破传统商业思维，开创“3 X”跨界商业模式，将零售、餐饮、娱乐等业态进行创新组合。围绕生活天地、创意集市、国际时尚、潮流风尚、亲子空间、饕餮美食、休闲殿堂七大商业主题，将精品超市、创意休闲集市、国际快时尚服饰、潮流运动、咖啡甜品、全球美食、休闲餐饮、跨界书店、影音娱乐、美容健康等业态进行跨界组合，特别打造整层亲子空间，提供儿童培训、零售、娱乐，打造亲子互动空间，可满足全家人各年龄段全方位享受。\n宜奥商圈历经10年发展，厚积薄发！作为宜奥商圈升级的开篇之作，两江中迪广场，用创新的商业模式，打造全新的宜奥国际商圈，让世界看到更具国际范的新重庆商业形象。两江中迪广场，启幕宜奥商圈新时代。', '2019-07-26 10:27:51', '81077bf5-898f-451d-89cc-1c1d1d27dfb5', '2019-07-26 11:50:21', '81077bf5-898f-451d-89cc-1c1d1d27dfb5', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
