INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('91EB1774-BFA9-47A9-B348-CC459FB42450', '重庆市渝北区金州大道106号', '500319', 1104, 105, 1000000, '500000', 'e4106dce-9d0c-47de-85f7-66ffe8344ddf', '500300', 366666, 30, 5000, '2054-03-30 00:00:00', 472.4000, 88.5600, '北大资源博雅', '北大资源集团北京方诚物业经营管理有限公司', 8.0000, 1116, 40, 837, 2.7, '何志鹏', '18580150588', 100.0000, '一手商铺销售', '2018-10-15 00:00:00', '2019-03-30 00:00:00', '住宅', 67, 130, 63, 1, NULL, '106.53933985530561', '29.65449568435926', NULL, '106.532845', '29.648446', 38.720000, 278.080000, '2018/12/91EB1774-BFA9-47A9-B348-CC459FB42450/7BDC1217-93EC-47A1-8A9E-FAF3296B1CA5_360_215_ICON_1.jpg', 8, NULL, '3b58adf3-bb61-4215-9ca7-453e09365082', '2019-04-11 10:05:04', 8, '北大资源博雅，位于两江新区核心照母山高端居住区。区域是“中国第三区”未来潜力很大。项目毗邻照母山公园，占地约13万平米，总建筑面积约50万平米，集高层、花园洋房、中心商业、社区商业等业态。北大资源博雅，交通便捷，项目近享区域内公园、商业等外部城市配套，有北大资源教育、医疗、科技、金融、商业5大配套。', '2018-12-19 17:42:51', '946cddf4-065c-43a7-88d1-b2c39b024c4f', '2019-07-30 09:03:10', '946cddf4-065c-43a7-88d1-b2c39b024c4f', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
