INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('9aa28ade-db40-4e4b-a5ad-aa29626df1eb', '郑州市中原区五龙口南路与冉屯东路交叉口北50米', '1000308', 4388, 16, 3500000, '1000000', '31be54f5-fabd-4fc5-8624-cf19f2469a60', '1000300', 518500, 30, 4398, '2055-06-01 00:00:00', 12000.0000, 0.0000, '建业富力五龙新城', '广州天力物业发展有限公司', 4.5000, NULL, 40, 191, 4.7, '侯建', '18003701208', 350.0000, '一手商铺销售', NULL, NULL, '住宅', NULL, NULL, NULL, 1, NULL, '113.61391150244134', '34.80475201405894', NULL, '113.607399', '34.798798', NULL, NULL, '2019/10/9aa28ade-db40-4e4b-a5ad-aa29626df1eb/60f47d1f-8578-453c-a409-7c3280913d97_360_215_ICON_1.jpg', 8, '2019-09-10 18:02:36', '0170817f-902e-42e6-8ab1-7e8a126ddd0a', '2019-10-10 15:30:27', 8, '五龙新城是全国地产十强广州富力地产与建业集团强强联合共同开发的大型综合体项目。项目位于中原区，行政区划隶属高新区，整个项目东起嵩山路、西至秦岭路、南临五龙口路、北达北环快速路，是高新区和老城区的黄金旺角，地理位置极其优越，项目紧邻金水区和惠济区，属于四区域连接地带，在区域资源共享方面具有得天独厚的优势。建成后将会是郑州市西北片区域最具标志性的城市综合体五龙新城总占地778亩，总建筑面积350万㎡，集大型购物中心、高档会所，一站式教育体系、精品住宅、办公等多形态物业为一体。', '2019-10-10 14:19:06', 'e2752883-77bc-4eea-951d-d44756e21a95', '2019-10-10 18:02:36', 'e2752883-77bc-4eea-951d-d44756e21a95', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('9bbbddbf-d6d9-4b0c-acb2-dd27a7ef0498', '重庆市渝北区金州大道23号', '500326', 400, 2, 44216, '500000', '09e9957b-fbb2-45ca-9c41-22a441bf3d98', '500300', 10193, 10, 1074, '2052-12-30 00:00:00', 55.0000, 55.0000, '建工嘉寓', '重庆渝豪仕物业管理有限公司', 3.5000, 442, 40, 1040, 2.5, '黄春华', '18502357155', NULL, '一手公寓销售', '2019-09-11 00:00:00', '2019-12-31 00:00:00', '公寓', 1040, 1040, 0, 1, NULL, '106.5345643813734', '29.650291614649518', NULL, '106.528051', '29.644323', 33.730000, 40.970000, '2019/9/9bbbddbf-d6d9-4b0c-acb2-dd27a7ef0498/79f106e3-a567-47a0-aa6f-c8ce65a66ae1_360_215_ICON_1.jpg', 8, '2019-08-16 15:13:03', '3b58adf3-bb61-4215-9ca7-453e09365082', '2019-09-16 15:13:03', 0, '1.一步入繁华间，耀启金州商圈。建工嘉寓位踞金州商圈中轴之上，其价值高度将与区域发展共兴，增值前景与商圈崛起比翼齐飞。投资价值必然几何倍增，是藏品级城市商圈资产。入主建工嘉寓，坐享近200万方商圈醇熟配套，满足顶奢时尚消费体验。\n2.轻轨交通5号线，掌握城市动脉。时间就是生命，速度就是财富，优越的交通条件是物业增保值的关键要素。建工嘉寓近靠轨道5号线重光站，并有金开、金山双大道加持，可迅捷通达江北机场、重庆北站等交通枢纽和新牌坊、观音桥、中央商务区、国际博览中心等各大核心区域，更可实现新的价值机遇，优化资产配置，是城市菁英人士的理想置业选择。\n3.全能型公寓，荟萃城市菁英。建工嘉寓，将以超前的设计规划，面对不同置业人群，可办公、可投资、可自住，还可作为娱乐性性用房，用途广泛，更为灵活。建工嘉寓功用百变灵活，一栋将打造为品质酒店、民宿、办公商务等为一体的混合商寓，另一栋拟打造为时尚高端公寓，享星级酒店式管理服务。\n4.用臻装品质，诠释智慧生活。全装修交付标准，缩短使用等待时间，装修品质高，免去装修干扰和污染烦恼，交付即可入住；超10米挑高典雅大堂，出入星级尊贵，全面升级居家生活质感，建面约33-40m2精致户型，空间随心百变，投资自住皆宜；大堂区域WIFI，门禁系统、车牌自动识别、视频监控等智慧系统，全面升级品质生活新标准;裙楼定制专属社交平台花园，星级大堂内专设精致休闲书吧，赋予生活更多想象！\n5.活氧生态空间，城市百变秀场。城市快节奏生活往往压得人们难以喘息，于是许多人对于居住环境要求更高，建工嘉寓毗邻照母山，4300亩照母山森林公园，城市绿肺近在咫尺，下楼即享约2万方城市公园绿地。活氧健康休闲空间，商圈繁华与生态繁花共舞，成就现代都市人的减压舒逸生活场，是不可多得的优质地段。 照母山板块即将收官，稀缺之至。重庆建工地产年度巨献——建工·嘉寓，革新金州商圈高品质公寓格局，打造全新精致生活。商圈上·轻轨站·33-40m2臻装公寓，2019即将璀璨盛放。', '2019-09-05 11:21:43', '81077bf5-898f-451d-89cc-1c1d1d27dfb5', '2019-09-16 14:53:56', '81077bf5-898f-451d-89cc-1c1d1d27dfb5', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('9C9F9F67-4375-4864-B10D-66DBBEBD180F', '南京市建邺区江东南路与江山大街交汇处 ', '700407', 1532, 9, 1110000, '700000', '55c0e860-19cd-44ab-969a-b026904edc62', '700400', 123196, 35.5, 1896, '2053-02-04 00:00:00', 220.4800, 144.8000, '汇金中心', '上海高力国际物业服务有限公司', 5.5000, NULL, 40, 1896, 6, '盛云龙', '15852917570', 111.0000, '一手商铺销售', '2019-04-01 00:00:00', '2019-12-31 00:00:00', '公寓', 2, 2, 0, 1, NULL, '118.71763228110895', '31.987350760472307', NULL, '118.711128', '31.981372', 58.000000, 88.000000, '2019/8/9C9F9F67-4375-4864-B10D-66DBBEBD180F/d0b859e1-b136-4b0a-bdc6-4a00d520fef1_360_215_ICON_1.jpg', 8, '2019-07-09 11:59:59', '76145e5c-08f5-4621-b526-5af123636420', '2019-08-09 10:21:36', 8, '升龙汇金中心是由上海升龙集团投资、南京升龙房地产开发有限公司开发的商务综合体项目。升龙集团创办于1999年，总部位于上海市浦东新区陆家嘴东亚银行。经过14年的发展，集团业务现涉及房地产开发、商业管理、酒店运营、银行投资四大战略板块，并在香港、上海、福州、厦门、武汉、昆明、太原、泉州、郑州、天津、洛阳、新乡等国内十五个城市成功开发了30多座城市综合体，累计总投资额超过1200亿，开发面积超3000万平方米，是2012年度中国百强房企，是目前中国具有代表性的城市综合体运营商。\n项目位于河西板块江东南路与江山大道交汇处，地块东至恒河路，西至江东南路，北至江山大道，南至规划路。项目片区商业商务氛围浓厚，奥体中心、南京国际博览中心、青奥城、未来市政府、地铁7号线及12号线（建设中）环侍项目地块，商务办公气氛集中，未来世界500强的好选择。\n南京汇金中心占地123196.87㎡，总建筑面积超过111万㎡，项目规划9大建筑群，规划2栋300米写字楼，2栋200米写字楼，1座100米精品办公，2栋150米高端公寓，1栋100米精品公寓，1座超五星万豪酒店，以及国际购物中心、时尚消费街区和总部企业TOP级上层会所，更有23000平米广场……将“HOPSCA”所能涉及的业态融为一体。												\n', '2019-08-09 09:31:42', '7a5db1ea-828c-4c9a-9758-188a9a113776', '2019-08-09 11:59:59', '7a5db1ea-828c-4c9a-9758-188a9a113776', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('9e28e85b-dae3-4b18-bf70-d067d7165329', '成都市成华区府青路二段', '600503', 1050, 5, 225139, '600000', '04abc79c-05f6-4f79-a545-40dc8695da70', '600500', 50983, NULL, NULL, '2040-06-30 00:00:00', 790.1400, 377.8800, '成都协信中心', '重庆天骄物业管理服务有限公司', 8.0000, NULL, 40, 116, 4.5, '万军良', '13666226967', 22.5000, '一手商铺销售', '2019-05-01 00:00:00', '2019-12-31 00:00:00', '商办项目', 9, 12, 3, 1, NULL, NULL, NULL, NULL, NULL, NULL, 119.950000, 365.680000, '2019/6/9e28e85b-dae3-4b18-bf70-d067d7165329/6a954d1a-5102-49e0-95ad-2a6d4c7cc88b_360_215_ICON_1.jpg', 8, NULL, 'bdee5fe4-6259-4556-83a3-b3501f19ae71', '2019-06-05 16:24:15', 8, '项目位于成都的东北面,是政府重点打造的城东RBD休闲商务圈的核心位置，临近传统的红星路商圈，以及繁华的建设路商圈，北面靠近二环路东一段，西临府青路二段，南侧与东侧临近沙河。项目是依托成华区政府北改经济规划以及1413发展战略在城东打造的首个以国际五星级酒店、甲级写字楼、精品住宅、时尚商业街为一体的城市综合体项目。', '2019-06-05 14:32:17', '3504c3c4-fd4d-4503-9628-ab2e3d781294', '2019-06-05 16:24:15', '3504c3c4-fd4d-4503-9628-ab2e3d781294', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('a3637f1c-ac63-4236-875d-416a75cd2a4f', '重庆市渝北区金渝大道华侨城华悦中心', '500312', 1562, 5, 220992, '500000', 'd9659dee-10b6-4a07-96ab-c2647917c7a2', '500300', 39570, 30, 1972, '2053-06-02 00:00:00', 2183.9100, 150.5100, '华侨城华悦中心', '华侨城物业管理有限公司', 7.0000, NULL, 40, 350, 3.9, '洪中', '17782318679', 22.0000, '一手商铺销售', NULL, NULL, '商铺', 10, 68, 2, 1, NULL, '106.51913792998684', '29.673290534883023', NULL, '106.512549', '29.667537', 36.860000, 1727.590000, '2019/5/a3637f1c-ac63-4236-875d-416a75cd2a4f/b6aa8099-5323-4ae9-b015-f1793bb35353_360_215_ICON_1.jpg', 8, NULL, '3b58adf3-bb61-4215-9ca7-453e09365082', '2019-05-15 10:13:39', 8, '重庆华侨城，深圳华侨城之后的第二规模造城，4平方公里生态创想城区中，以旅游+地产的开发模式，建设一座人文与艺术并重，自然与繁华兼得的城区，成为数万高端消费力的生活主场。\n2017年，全国首座山地版欢乐谷、启幕亲水娱乐新模式的玛雅海滩水公园（在建）将双园齐开，配合多轨道交通、多公交站点、三立交、三隧道、二桥及三纵二横主干道所构筑的立体交通路网，必将聚引全城人潮，成为重庆全新的消费热土。\n约9万方华侨城艺术商业，2017年重庆华侨城战略级产品：双地铁站口商铺，近拥来自全城的无限消费力；创新5.1m层高loft、多变SOHO公寓，注入华侨城创想理念，随心满足多种商业功能需求，开创城市全新商业模式。华悦中心，以其不可复制的区位与限量的席位，奠定未来的价值生长。', '2019-05-15 09:20:40', '00d11ef7-7d32-4551-bd51-d8858db72611', '2019-07-30 09:03:25', '946cddf4-065c-43a7-88d1-b2c39b024c4f', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('a49802b9-7841-4803-8fdf-ea95ae88ec13', '重庆市江北区洋河一路', '00215', 1327, 2, 180000, '500000', '39878a1c-4aef-42e5-9c37-489934d1fee8', '500200', 15277, 30, NULL, NULL, 12000.0000, 0.0000, '新华协信中心', '天骄爱生活有限公司', 10.0000, NULL, 40, NULL, 7.5, '余柏霖', '18696576111', NULL, '一手公寓销售', '2019-07-27 00:00:00', '2019-12-31 00:00:00', '写字楼', NULL, NULL, NULL, 1, NULL, '106.53804522539286', '29.584609312062078', NULL, NULL, NULL, NULL, NULL, '2019/8/a49802b9-7841-4803-8fdf-ea95ae88ec13/affa101e-2e77-4083-90b1-9c29d69dc925_360_215_ICON_1.jpg', 0, NULL, '3b58adf3-bb61-4215-9ca7-453e09365082', NULL, 0, '新华协信中心由新华与协信两大房企联合打造。项目建成后将成为观音桥第2、重庆第6、全国第10座协信 。新华协信中心占地1.6万平方米，总建筑面积18万方，打造西南地标级城市综合体，项目产品涵盖 品购物 、5A甲级写字楼、服务式非毛坯公寓三大业态。其中超6万方购物，为星光68B馆，位于协信5大星光系商业，计划引进水族馆书城等体验式商业形态，与星光68形成业态互补，将再一次，颠覆观音桥商业格局。商务公寓将针对商圈100万商务精英打造专属服务式公寓。5A甲级写字楼，以超高硬件配置，打造观音桥星光之上定制级企业金融资产，重振观音桥价值， 助力重庆城市未来。', '2019-08-05 10:58:26', '81077bf5-898f-451d-89cc-1c1d1d27dfb5', '2019-08-12 10:53:15', '81077bf5-898f-451d-89cc-1c1d1d27dfb5', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
