INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('A8B45085-25FF-4963-9128-A5149343EFD9', '重庆市沙坪坝区光明路66号', '500509', 1264, 23, 280000, '500000', '65fe2704-c7a9-43dd-b7ee-9805e0beb1a3', '500500', 70000, 35, 2100, '2054-04-29 00:00:00', 285.9800, 32.0200, '华宇温莎小镇', '华宇物业服务有限公司', 4.0000, 1264, 40, 220, 3, '申浩哲', '15998959138', 28.0000, '一手商铺销售', '2018-10-20 00:00:00', '2019-03-11 00:00:00', '小镇', 58, 63, 5, 1, '65fe2704-c7a9-43dd-b7ee-9805e0beb1a3', '106.4519663826633', '29.61578861711024', NULL, '106.445571', '29.609488', 20.740000, 104.170000, '2018/11/A8B45085-25FF-4963-9128-A5149343EFD9/EEB60E95-B6FB-4FEA-93F9-F60526A27084_360_215_ICON_1.jpg', 8, NULL, '3b58adf3-bb61-4215-9ca7-453e09365082', '2019-04-05 15:55:17', 8, '    华宇温莎小镇是华宇集团在沙区打造的首个住宅+主题商业的综合性高端楼盘，项目占地105亩，总建筑面积28万方，容积率为3.0。一期已于2017年5月底交房，二期即将在明年9月底交房。\n整个温莎小镇共2100户，未来常住人口共约7000人；项目北面的宏城名都共约3000多户10000人，东面与南面的嘉陵厂家属区约10000人。温莎小镇项目与周边共近3万常住人口，除了好吃街之外，项目周围的家属区和宏城名都基本无商业。温莎小镇为项目及周边的2万常驻人口打造“英伦风情街区商业“，以满足项目及周边庞大常住人口的消费需求。我们的“英伦风情街区商业“有五大特点：\n1、主题商业：采用英伦风情外立面设计，区别于周边现代建筑，使整个商业街一眼看上去就与众不同，吸引消费（例：成都太古里、重庆天地）；\n2、街区商业：也是区别于周边传统的社区商业，内街外街相连，楼上楼下相通，外摆空间大，增强消费人群游逛性和停留时间；\n3、稀缺商业：本项目常驻人口约7000人，商业总面积约16000㎡，人均商业面积2.28㎡/人（平均人均商业面积3㎡/人）。\n4、商圈商业：项目所在的位置是“井双新城”核心，双碑的人群聚集地，而且项目南面紧邻轨道1号线双碑站及双碑目前最大的商业集中地，打造商业中心的基础条件。项目西面的地块规划与现有九重锦商业和地铁双碑站联通，打造“井双新城商圈”，温莎小镇“英伦风情街区商业”则紧处于未来的“井双新城商圈”中，是名副其实的商圈商业，未来商业价值极高，趁现在还没完全成熟的低价入手，回报极高。\n    整个“英伦风情街区商业”，紧靠售房部这部分是已经售罄的街区商业，目前一层租金约80-130元/㎡，二层租金约40-50元/㎡，一层主要经营特色餐饮和休闲餐饮，二层主要经营教育培训业态；一期S1邻里商业街，主要经营特色餐饮与社区生活配套（便利店、洗衣店、快递等业态）。', '2018-11-27 17:32:19', '946cddf4-065c-43a7-88d1-b2c39b024c4f', '2019-07-01 10:53:44', '00d11ef7-7d32-4551-bd51-d8858db72611', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
