INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('aa51d407-2fbd-439d-9968-61559dceaf2a', '天合广场凤台南路与雨花南路交叉口100米', '700601', 781, 2, 108271, '700000', '84b2b103-080d-4f05-acde-efa63ed82602', '700600', 11028, 39, 139, '2055-10-18 00:00:00', 502.9000, 321.6200, '天合广场', '浙江开元物业管理股份有限公司', 7.0000, NULL, 40, 139, 7.9, '芮之', '13951938088', 10.8000, '一手商铺', '2019-06-01 00:00:00', '2019-12-31 00:00:00', '商办项目', 6, 6, 0, 1, NULL, '118.758611', '32.002056', NULL, '118.752048', '31.996347', 53.290000, 80.980000, '2019/7/aa51d407-2fbd-439d-9968-61559dceaf2a/313BD023-831A-41AE-BBD2-7E92EE4B0894_360_215_ICON_1.jpg', 8, NULL, '76145e5c-08f5-4621-b526-5af123636420', '2019-07-02 09:41:23', 8, '天合广场项目是由江苏省供销合作经济产业园公司开发建设的5A甲级写字楼项目，公司隶属江苏省供销合作社！为弘扬工匠精神、体现国企品质，项目力争夺得全国建筑行业工程质量的最高荣誉——鲁班奖！项目位于城市核心区域凤台南路与梦都大街交叉口，周边路网通达。\n项目周边多条地铁直达，其中地铁1号线、10号线已建成使用；地铁7号线正在建设中预计2021年建成通常，本案距离地铁7号线东青石站仅800米；项目东侧一路之隔即为规划的地铁8号线凤台南路站。\n整个项目建成后将达到美国LEED绿色建筑标准，以办公自动化、通讯自动化、消防自动化、安保自动化、楼宇控制自动的5A标准成为雨花区的地标性建筑！', '2019-06-28 15:13:40', '7a5db1ea-828c-4c9a-9758-188a9a113776', '2019-07-02 09:41:23', '7a5db1ea-828c-4c9a-9758-188a9a113776', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('aab5c292-7db2-4c1d-b7be-496414a6c146', '科学大道西三环西800米（解放军信息工程大学东）', '1000314', 3082, 13, 330070, '1000000', '37f59ea6-897c-4e5c-a730-f266d59c1bee', '1000300', 82430, 30, 23437, '2058-04-24 00:00:00', 72.2800, 47.9000, '福晟谦祥钱隆城', '郑州福谦物业管理有限公司', 3.9000, NULL, 40, 924, 4.5, '曹盈盈', '18037127770', 33.0000, '一手公寓销售', '2019-06-17 00:00:00', '2019-12-31 00:00:00', '公寓', 462, 462, 0, 1, NULL, '113.5914870121652', '34.81426598464339', NULL, '113.584878', '34.808593', 42.250000, 66.510000, '2019/7/aab5c292-7db2-4c1d-b7be-496414a6c146/87336002-a1cb-4505-81fd-2965985f19dd_360_215_ICON_1.jpg', 8, NULL, '0170817f-902e-42e6-8ab1-7e8a126ddd0a', '2019-07-18 17:33:33', 8, '福晟·谦祥·钱隆城项目，由中国房企39强福晟集团，中国实力房企谦祥集团，双强携手钜献。品牌坚持以专业精神和热忱态度，致力于打造“以人为本”的臻品建筑。钱隆城规划为33万方综合城邦，汇集高新万达商圈、高端商务、新古典华宅、精品酒店、星级公寓5大繁华业态于一体；项目占地面积82430平方米，建筑面积约33万方。雄踞中原区科学大道主干道，无缝接驳连霍高速、京广快速路等城市重点道路与区域，地铁1/8/9号线环伺（8、9号线规划中），五纵五横路网脉动全城；全新5维生活理念，拥享华师教育，签约华中师范附小、附中，助力孩子成长，万达商业入驻，构建一站式繁华生活场；三河五园五重景观，涵养生活美境；甲等医资环伺，构建运动康体社区，360°礼遇人生峰境，贴心服务居者生活。													\n', '2019-07-18 15:03:47', 'e2752883-77bc-4eea-951d-d44756e21a95', '2019-07-18 17:33:33', 'e2752883-77bc-4eea-951d-d44756e21a95', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('ae062f06-2cca-46cc-92d1-5c92be4216e3', '金牛区天龙大道1333号', '600306', NULL, 14, 160291, '600000', '6c71b3b6-8481-40dc-9614-14764626ee60', '600300', 61133, 18, 764, '2054-01-06 00:00:00', 3463.0000, 3463.0000, '北斗七星城', '成都利丰物业有限公司', 6.0000, NULL, 40, 120, 3, '欧阳晟', '19983511984', 16.0300, '', '2019-09-27 00:00:00', '2020-02-29 00:00:00', '商铺', 1, 1, 0, 1, NULL, '104.10486618757129', '30.777663798684962', NULL, '104.098266', '30.771973', 1827.540000, 1827.540000, '2019/6/ae062f06-2cca-46cc-92d1-5c92be4216e3/b9ef9c0a-52ba-4987-8865-7dd2cef1fb39_360_215_ICON_1.jpg', 8, '2019-09-11 10:05:39', 'bdee5fe4-6259-4556-83a3-b3501f19ae71', '2019-06-10 16:46:26', 8, '北斗七星城位于金牛区北部新城，是西部北斗甲级产业园配套建设的商业住宅区，东毗天回古镇，南倚凤凰山，西靠城北副中心，北邻国际商贸城，自然人文环境优美，交通便捷。项目有住宅、商业、公寓、星级酒店，品质高端、配套丰富、生活便捷。', '2019-06-10 16:17:13', '3504c3c4-fd4d-4503-9628-ab2e3d781294', '2019-10-11 10:05:39', '3504c3c4-fd4d-4503-9628-ab2e3d781294', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
