INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('b19039c8-9cbc-4a6b-b142-7b40e6c6cb20', '郑州市高新区西三环科学大道向西200米', '1000701', 664, 6, 163700, '1000000', '37f59ea6-897c-4e5c-a730-f266d59c1bee', '1000700', 25920, 30, 1226, '2086-10-18 00:00:00', 266.2200, 152.5400, '福晟谦祥钱隆城郁香苑', '万科睿服务', 5.0000, 3227, 70, 15, 4.5, '王悦', '15617942763', 16.3700, '一手商铺销售', '2019-05-22 00:00:00', '2019-09-22 00:00:00', '住宅', 4, 9, 4, 1, NULL, NULL, NULL, NULL, NULL, NULL, 50.220000, 99.350000, '2019/6/b19039c8-9cbc-4a6b-b142-7b40e6c6cb20/ce212a2a-b5f7-4e6d-bef9-500aeb27e039_360_215_ICON_1.jpg', 8, NULL, '0170817f-902e-42e6-8ab1-7e8a126ddd0a', '2019-06-21 11:44:19', 8, '福晟谦祥钱隆城项目，由中国房企39强福晟集团，中国实力房企谦祥集团，双强携手钜献。品牌坚持以专业精神和热忱态度，致力于打造“以人为本”的臻品建筑。钱隆城规划为450万方综合城邦，汇集高新万达商圈、高端商务、新古典华宅、精品酒店、星级公寓5大繁华业态于一体；项目总占地面积1500余亩，总建筑面积约450万方。雄踞高新区科学大道主干道，无缝接驳连霍高速、京广快速路等城市重点道路与区域，地铁1/8/9号线环伺（8、9号线规划中），五纵五横路网脉动全城；全新5维生活理念，拥享华师教育，签约华中师范附小、附中，助力孩子成长；高新万达商业入驻，构建一站式繁华生活场；三河五园五重景观，涵养生活美境；甲等医资环伺，构建运动康体社区；万科物业睿服务，360°礼遇人生峰境，贴心服务居者生活。项目二期新品万華府荣耀入市，0元入会会员全城招募中。				\n', '2019-06-21 11:38:27', 'e2752883-77bc-4eea-951d-d44756e21a95', '2019-06-21 19:24:21', '00d11ef7-7d32-4551-bd51-d8858db72611', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('B56CFE01-837B-46DD-8D76-5316FC418406', '四川省成都市成华区建祥路9号', '600504', 950, 2, 136529, '600000', 'd9fe3f36-7c94-4762-964e-ed905adaa1a6', '600500', 13533, 20, 734, '2054-11-26 00:00:00', 120.4400, 54.5300, '朗基城', '成都郎逸物业服务有限公司', 6.8000, NULL, 40, 734, 7, '李雪', '18628055517', 13.6000, '一手公寓销售', '2019-04-17 00:00:00', '2019-07-16 00:00:00', '公寓', 373, 377, 4, 1, NULL, NULL, NULL, NULL, NULL, NULL, 36.350000, 80.290000, '2019/4/B56CFE01-837B-46DD-8D76-5316FC418406/C89CB85D-B190-49F4-9D69-73D201F7CF31_360_215_ICON_1.jpg', 8, NULL, 'bdee5fe4-6259-4556-83a3-b3501f19ae71', '2019-04-26 16:44:35', 8, '朗基城是朗基地产在成都主城区又一力作，项目位于仅此春熙路商圈之后的“成都第二商圈”——建设路商圈。总占地20.38亩，总建筑面积约13.9万平方米，本项目由1栋商办、1栋住宅和集中商业组成。其中住宅360户、商办总734户，额外项目自带1.8㎡商业裙楼；目前主推朗基城少公馆的办公类产品，总建筑高度超100米，整栋楼采用钻石立面[设计核实]落地玻璃幕墙，配置中央空调。建成之后将成为建设路版块天际地标性建筑。项目将“摩登立体都汇”的创新式理念融入产品，打造区域内标杆性城市综合体项目，引领建设路时尚潮流。', '2019-04-24 15:07:37', '946cddf4-065c-43a7-88d1-b2c39b024c4f', '2019-04-26 16:44:35', '946cddf4-065c-43a7-88d1-b2c39b024c4f', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('b7f655f2-8e8d-4f6c-b431-32e6790241a2', '郑州航空港区华夏大道与护航路交叉口西南角', '1001301', 3282, 11, 360260, '1000000', '6661b044-0f7b-4310-9210-47ffe65a4f5c', '1001300', 75860, 30, 800, '2043-08-20 00:00:00', 391.6100, 87.8400, '云瓴国际', '郑州高屋物业服务有限公司', 8.0000, NULL, 40, 51, 3, '邵永波', '13598093715', 36.0300, '一手商铺销售', NULL, NULL, '住宅', 38, 38, 0, 1, NULL, '113.84139398809116', '34.59940001136425', NULL, '113.834801', '34.593637', 39.430000, 266.920000, '2019/9/b7f655f2-8e8d-4f6c-b431-32e6790241a2/c9fe3562-2e1b-4153-b73d-1dd00c2c65e3_360_215_ICON_1.jpg', 8, '2019-08-11 16:34:39', '0170817f-902e-42e6-8ab1-7e8a126ddd0a', '2019-09-11 15:26:19', 8, '云瓴国际位于郑州航空港区四港联动大道与郑港一路交汇处，总占地面积约114亩，总建筑面积36万平方米，项目包含三栋写字楼、酒店、LOFT区、商业。', '2019-09-11 11:21:52', 'e2752883-77bc-4eea-951d-d44756e21a95', '2019-09-11 16:34:39', 'e2752883-77bc-4eea-951d-d44756e21a95', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('b85aa465-b67f-45ee-884f-17ff9093ef16', '河南省郑州市中原区长椿路与莲花街交汇处北100米', '1000315', 2040, 33, 1280000, '1000000', 'd7437bef-a993-419c-9c6a-9e687f2f2923', '1000300', 307333, 40, 4021, '2085-04-22 00:00:00', 670.2400, 218.4700, '谦祥万和城', '盛基物业', 4.5000, NULL, 70, 350, 3.5, '刘文刚', '18039109006', 128.0000, '一手商铺销售', '2019-04-04 00:00:00', '2019-09-15 00:00:00', '住宅', 23, 45, 22, 1, 'd7437bef-a993-419c-9c6a-9e687f2f2923', '113.545372', '34.839394', NULL, '113.538911', '34.833201', 92.000000, 303.000000, '2019/4/b85aa465-b67f-45ee-884f-17ff9093ef16/1b58c0fd-b735-42de-a665-81acb4b50a3f_360_215_ICON_1.jpg', 8, '2019-07-13 14:41:47', '0170817f-902e-42e6-8ab1-7e8a126ddd0a', '2019-04-24 10:31:45', 8, '谦祥万和城是由河南谦茂置业有限公司在高新区开发的70年产权现房底商项目。谦祥集团是一家以房地产开发为主营业务，实行多元化经营的综合性企业。谦祥万和城东起长椿路、西至月季街、北接新龙路、南至莲花街。谦祥万和城项目总占地461亩，总建筑面积约128万方，项目总体规划由A、B、C、D、E五大地块组成，涵盖高层住宅、大型商业、写字楼等多种物业形态。', '2019-04-17 14:50:07', '00d11ef7-7d32-4551-bd51-d8858db72611', '2019-08-13 14:41:46', 'e2752883-77bc-4eea-951d-d44756e21a95', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('b8be1338-7af3-4613-918d-ed733151a384', '重庆市渝中区朝天门新华路3号', '500101', 1844, 1, 268000, '500000', '1b67e9b2-e909-436a-95d2-da7a82ac1cca', '500100', 186000, NULL, 921, '2053-12-30 00:00:00', 309.3800, 130.8300, '光大控股朝天门中心', '重庆朝天骏博商业管理有限公司', 6.5000, NULL, 40, 746, 10.11, '熊杰', '18523069299', 26.8000, '一手公寓销售', '2019-08-01 00:00:00', '2019-10-31 00:00:00', '公寓', 221, 242, 10, 1, NULL, '106.59154398968303', '29.568656035484718', NULL, '106.585052', '29.56257', 51.230000, 93.750000, '2019/8/b8be1338-7af3-4613-918d-ed733151a384/3b149483-572c-4e7f-a267-5472f8714fcc_360_215_ICON_1.jpg', 8, '2019-07-12 17:46:29', '3b58adf3-bb61-4215-9ca7-453e09365082', '2019-08-12 13:45:22', 8, '光大控股·朝天门中心秉承产业赋能的使命，打造集“ 产、学、研、展、商、住、娱、办”八项产业内容的CGC PARK（CHINA GIRL COLLECTION）时尚美学综合体，是涵盖时装流通场景、潮流发布、生活方式以及产业社群和帮助提升商户经营能力的服装全产业生态链，其一期大融汇商业与二期公寓体量共26.8万方。中国乃至亚洲的潮流时尚发布秀场将在这里举办，年轻的时尚朝拜者将在这里汇聚，服装产业学习、设计、生产、商贸在这里发生。光大控股·朝天门中心将始终致力于成为为西南地区中小经营户提供优质时尚美学产品和服务的供应商平台，共铸朝天门时尚美学生态圈。', '2019-08-08 10:40:31', '81077bf5-898f-451d-89cc-1c1d1d27dfb5', '2019-08-12 17:46:29', '81077bf5-898f-451d-89cc-1c1d1d27dfb5', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('bd395322-3e9f-404b-81a4-05320907bb29', '重庆市巴南区李家沱正街230号', '500702', 1907, 18, 276303, '500000', '4d00c67e-1878-4404-891a-ac9b2ce3a769', '500700', 63884, 30, 1745, '2057-07-30 00:00:00', 12000.0000, 0.0000, '协信天骄星城', '协信天骄爱生活物业有限公司', 6.0000, NULL, 40, 187, 3.26, '欧阳远林', '13564462888', NULL, '一手商铺销售', '2019-08-10 00:00:00', '2020-06-30 00:00:00', '商铺', NULL, 128, 0, 1, NULL, '106.54883387456414', '29.46692392471675', NULL, '106.542388', '29.460732', NULL, NULL, '2019/8/bd395322-3e9f-404b-81a4-05320907bb29/c85b00ef-61a8-4a62-8a23-1d4f4dd4a800_360_215_ICON_1.jpg', 8, '2019-07-20 11:48:37', '3b58adf3-bb61-4215-9ca7-453e09365082', '2019-08-20 11:48:37', 0, '匠心协信集23载地产精研大成，以革新城市面貌，提升城市价值，推动品质生活演进的善筑用心，打造TOP产品天骄系——协信天骄星城。项目总占地近300亩，总建筑面积约90万㎡，业态涵盖：花园洋房、景观洋楼、阔景高层、城市公寓、格调商业，踞李家沱商圈正心、重庆（CAZ）重要功能规划区中央，依花溪河畔而生，著造南重庆榜样都会范本。 项目的住宅建筑为Artdeco风格，通过立体感强的装饰手法，升华设计理念，打造更加前沿的建筑时尚；结合民国风情的格调商业，将融合现代风格，在展现项目典雅气质的基础上，强化现代感、艺术感及自然感，充分利用光影、色彩等元素强化空间的灵动性和多变性，绘出刚柔并齐的独一外立面。通过“融合 定制 自然主义”的景观主题，定制艺术小品、绘出空间山水线条、规划场地形态，整体形成融合互动花园的自然空间感受，为业主打造“公园里的家”。以“1轴1带2园1环”环绕，将自然写意、运动休闲与儿童娱乐相结合，让居者体验更精妙的园林风光。 高端的品质地产运营集成天骄星城的天赋凛然，超百万方的品质商业汇聚繁华似锦，周边有都和广场、百年广场等醇熟商业环绕，更有蓄势待发的协信大体量商业体；丰富的娱乐设施享受更欢愉的休闲生活，近享海洋公园、冰巴水世界等娱乐配套；优质的教育资源感受人文学脉，品牌幼儿园、江南小学（规划中）、花溪中学等学府环绕；优质的医疗配套体验安心住家时光，国家级二甲医院第七人民医院、花溪医院等护航您和家人健康。', '2019-08-19 16:24:38', '81077bf5-898f-451d-89cc-1c1d1d27dfb5', '2019-08-20 11:43:04', '81077bf5-898f-451d-89cc-1c1d1d27dfb5', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
