INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('c9250233-f943-4836-a769-5215ada2fe97', '浙江省杭州市余杭区良渚街道棕榈路801号', '710201', 700, 13, 182308, '710000', 'b8eeab4b-e61b-4fad-b39f-7767b50acb89', '710200', 51900, 30, 1228, '2083-05-15 00:00:00', 700.7600, 387.7800, '赞之城', '万科物业', 3.0000, 1017, 40, 50, 2.6, '马宏', '13901974418', 18.0000, '一手商铺销售', '2019-07-01 00:00:00', '2019-12-31 00:00:00', '住宅', 8, 9, 1, 1, NULL, '120.11126708984375', '30.38395881652832', NULL, '120.104815', '30.377703', 162.870000, 332.880000, '2019/6/c9250233-f943-4836-a769-5215ada2fe97/4211b651-1799-4d2e-b388-44a026754e08_360_215_ICON_1.jpg', 8, '2019-07-14 17:40:13', 'ff601870-c85e-453a-8d33-35f7da193115', '2019-06-27 15:44:05', 8, '赞成赞城，项目总占地面积51900平方米，总建筑面积约18万平方米，由13幢高层和9000多平米沿街商铺组成，户型面积88-120平方米；楼幢全是南北朝向，西面和南面均直面天然水岸，具有较好的景观资源。而且，在项目内还有一座建于清朝的古桥，名为永丰桥，已有300年左右的历史。这座桥不 仅是一座古桥，更是一个活的文化瑰宝，也是赞成赞城最具有历史韵味的景观。另外北部新城市场众多，配套丰富，未来发展潜力大。', '2019-06-27 14:32:09', '946cddf4-065c-43a7-88d1-b2c39b024c4f', '2019-08-14 17:40:13', '883abd19-3bf5-411b-9a13-8256901aae4c', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('ca54402d-ecea-4358-b25b-ad9bf4aabf23', '江北区石马河街道宏帆路28号', '500210', NULL, 47, 760000, '500000', '336e1992-50f5-4656-9dc7-a21ea10b17f2', '500200', 263335, 20, 7000, '2043-06-30 00:00:00', 340.9500, 66.4300, '宏帆凤凰湾', '宏帆物业管理有限公司', 5.0000, NULL, 40, 132, 2.93, '冉进', '15123999157', NULL, '一手商铺销售', '2019-05-18 00:00:00', '2019-08-15 00:00:00', '住宅', 18, 42, 22, 1, '336e1992-50f5-4656-9dc7-a21ea10b17f2', '106.47681434540206', '29.601161012609037', NULL, '106.470327', '29.59517', 62.140000, 295.620000, '2019/5/ca54402d-ecea-4358-b25b-ad9bf4aabf23/dad62c60-c6c7-44a9-83b1-e03e8a865a04_360_215_ICON_1.jpg', 8, NULL, '3b58adf3-bb61-4215-9ca7-453e09365082', '2019-05-28 10:24:35', 8, '宏帆凤凰湾位于北滨路一线三带中的生态住居区，江北区石马河宏帆路；总占地面积约395亩，建筑面积约76万方。是一个涵盖高端住宅、酒店、购物中心、学校等多元复合业态的低密度豪宅区。与凤凰湾毗邻的双碑大桥，同冉家坝、新牌坊、北环紧密相连，联袂内环快速路以及北滨路，改变该片区的交通现状，使其更加完善。通往江北、渝北、北部新区三大区域的纵向通道将全面打通。随着双碑大桥的通车，以凤凰湾为圆心的江北农场区域，已形成15分钟生活圈，一刻钟可抵观音桥、大学城，半小时通达江北城、解放碑以及江北国际机场。同时，双碑大桥打通了两江新区与西部新城之间、以及成渝经济带的黄金通道，并汇聚一大批世界五百强企业，凤凰湾无疑已成为最理想的国际化的高尚生活区。', '2019-05-28 10:23:53', '00d11ef7-7d32-4551-bd51-d8858db72611', '2019-07-01 10:55:10', '00d11ef7-7d32-4551-bd51-d8858db72611', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
