INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('cbf46ec4-b2d3-40b3-bc6c-7cf69798b77d', '成都市成华区嘉陵江路与九寨沟路交叉口西北角', '600501', NULL, 4, 92191, '600000', '1bd4200d-30d1-475f-8923-0916118f286a', '600500', 24339, NULL, 1125, '2053-10-10 00:00:00', 347.2000, 105.1200, '中迪中心公寓', '中迪地产下属物业公司', 5.0000, NULL, 40, 1125, NULL, '王莉钧', '18081018667', 9.2200, '', '2019-07-10 00:00:00', '2020-07-10 00:00:00', '公寓', 175, 175, 0, 1, NULL, '104.13759002001099', '30.63512586784004', NULL, '104.131076', '30.629102', 67.820000, 224.000000, '2019/8/cbf46ec4-b2d3-40b3-bc6c-7cf69798b77d/be9fe6c1-643d-4bba-8b10-50d90e9b9694_360_215_ICON_1.jpg', 8, '2019-08-16 14:21:27', 'bdee5fe4-6259-4556-83a3-b3501f19ae71', '2019-09-16 14:21:27', 0, '中迪中心坐落于主城成华区的成都东站——西南最大综合交通枢纽，集高铁、地铁、长途客运、城市公交于一体，以“零换乘”理念实现“人、铁、路、城”无缝衔接，是典型的TOD交通组织模式，目前日人流量约40万人次、年人流量约1.5亿人次，巨大的人流量为实施TOD综合开发提供了先天优势，东客站轨道站点TOD项目占地约600多亩，由商业综合体、酒店、公寓、住宅、办公、学校等业态组成。\n中迪中心项目由“中国房地产开发企业100强”企业中迪禾邦集团开发打造，总占地约66亩，集公园、商业、大平层、高端写字楼为一体。\n中迪中心缔造生长在公园里的建筑，站立区域核心地位，周边公园环绕，塔子山公园、中迪公园近在咫尺，建筑外立面采用恒树叠翠设计，打造约150米向上生长的花园，缔造城市前所未见的生态奇观，臻稀立面成为东中心的门户封面。\n\n', '2019-08-05 14:02:48', '3504c3c4-fd4d-4503-9628-ab2e3d781294', '2019-09-16 13:48:00', '3504c3c4-fd4d-4503-9628-ab2e3d781294', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('ce08f75a-452a-4983-a7db-f88eaa6efe2d', '重庆市沙坪坝区凤天大道169号', '500503', 5078, 2, 982140, '500000', '53ba7bd4-255b-43fe-a79d-afe0295ad56c', '500500', 188721, 35, 5306, '2049-10-30 00:00:00', 124.8000, 67.2000, '华宇城', '重庆华宇物业服务有限公司', 5.0000, NULL, 40, 580, 4, '谢浩', '18580573688', NULL, '一手公寓销售', '2019-09-14 00:00:00', '2019-10-31 00:00:00', '公寓', 580, 580, 0, 1, NULL, '106.45895086255426', '29.52817246151983', NULL, '106.452519', '29.521918', 42.000000, 78.000000, '2019/9/ce08f75a-452a-4983-a7db-f88eaa6efe2d/6d544157-1cb3-46f5-82dd-30d73f823c3d_360_215_ICON_1.jpg', 8, '2019-08-29 11:20:46', '3b58adf3-bb61-4215-9ca7-453e09365082', '2019-09-26 16:01:18', 1, '华宇城位于沙坪坝凤天大道，地处沙区和二郎片区的交汇处，百万方体量，涵盖25万方商业、45万方住宅、少量公寓、一座五星级酒店&5A甲级写字楼综合的摩天大厦。不仅享受环线，还享受轨道5、9号线，五桥七口，两横三纵四立交，畅达交通沟通全城。距离图书馆仅一站路，凤凰公园和绿壁公园近在咫尺，囊括重庆人文教育瞩目资源，是一座繁华缤纷的美好之城。项目囊括五星级酒店、甲级写字楼、时尚shopping mall、中心购物广场、风情商业街、ART-DECO风格精品高层、原创洋墅、中央别墅等多种物业形态，在不远的将来，华宇城将全面提升城市区域价值，具有华宇特色的第三代城市综合体将成为重庆西中心的核心商圈。华宇城将建成一个超过45万方的住宅大城，欧式古典主义的ART-DECO建筑风格，融合了浪漫的古典之美和现代的简约硬朗风格，以赭石色为主基调的外立面，在重庆雾都的天空下，独成一道亮丽的风景线。住宅包括有精品高层、原创洋墅、中央别墅等，规划4456户，居住人口逾14000人，势必将引起城市上流精英的圈层效应，继新牌坊、金开大道之后，打造属于沙区的高尚住宅区。华宇城规划有11万方的shopping mall及风情商业街，如同江北CBD、南坪CBD一样，每一个商圈的崛起，总是和他的大型城市综合体息息相关。华宇城的商业规划，将引进国内外一线潮流服装品牌、高档餐饮、连锁影院、大型超市等，一方面是对大量具有消费力的时尚人群的聚集，另一方面也能全面满足周边数万居民的生活所需，大型城市综合体将代言一个商圈的崛起。华宇第一太平戴维斯将提供国际化优质的5C钻石服务，本土惊喜洞察与百年国际经验联袂，只为带给你一种世界的都会生活。', '2019-09-25 11:27:23', '81077bf5-898f-451d-89cc-1c1d1d27dfb5', '2019-09-29 11:20:46', '81077bf5-898f-451d-89cc-1c1d1d27dfb5', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
