INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('db521009-70c6-41cf-b8f1-9ee8a4f96129', '重庆市大渡口区金建路38号', '500801', NULL, NULL, 20000, '500000', '3914b49c-7e79-4374-b2cb-ec4d6b7de298', '500800', NULL, NULL, NULL, NULL, 12000.0000, 0.0000, '荣盛城', '', NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, '106.46890399777098', '29.452258028563335', NULL, NULL, NULL, NULL, NULL, '2019/9/db521009-70c6-41cf-b8f1-9ee8a4f96129/e0e2d73c-dadf-49e9-82f9-3a8e6f6ff565_360_215_ICON_1.jpg', 0, NULL, '3b58adf3-bb61-4215-9ca7-453e09365082', NULL, 0, '荣盛城118万方超规格国际化城市巨擘占地1438亩，奢留约700亩土地打造大渡口区中央公园。荣盛城位于大渡口八桥组团的核心位置，优享政策利好，鼎力大渡口国际化大都市进程；占据优越的地理位置，经内环高速与重庆西站快速对接，近享轻轨2/5号线，经西城大道、华福大道、金建路、华福二路四条城市主干道，串联整个城市的交通；大渡口中医院和大渡口人民医院就在旁边，驱车直达新桥医院和西南医院；引进知名幼儿园、小学和中学，构建15年一站式教育体系；自建20万方风情商业，毗邻万达广场和九宫庙商圈；尊享国家一级物管资质——荣盛物业，打造您的精致美好生活。', '2019-09-21 17:37:05', '81077bf5-898f-451d-89cc-1c1d1d27dfb5', '2019-09-22 17:54:21', '81077bf5-898f-451d-89cc-1c1d1d27dfb5', '2019-09-23 15:28:28', '81077bf5-898f-451d-89cc-1c1d1d27dfb5', 1, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('DF9A057A-82A4-4AF1-97A9-5BEDA54D7E29', '重庆市巴南区龙州大道起点（渝南大道与箭河路交界处）', '500703', 5909, 25, 1159604, '500000', '85a6690e-8e6c-47c3-9d01-cc6b0f8ac36b', '500700', 53425, 35, 9000, '2052-06-29 00:00:00', 54.4700, 32.1800, '协信星澜汇', '重庆天骄爱生活有限公司', 3.5000, NULL, 40, 274, 1.75, '易红津', '13098778777', 115.9600, '一手公寓销售', '2019-04-17 00:00:00', '2019-09-30 00:00:00', '公寓', 141, 274, 132, 1, '85a6690e-8e6c-47c3-9d01-cc6b0f8ac36b', '106.54254744408811', '29.375939391185714', NULL, '106.536094', '29.369845', 35.760000, 60.520000, '2019/4/DF9A057A-82A4-4AF1-97A9-5BEDA54D7E29/076B0DCF-69E7-469C-B089-F03F29EFC211_360_215_ICON_1.jpg', 8, NULL, '3b58adf3-bb61-4215-9ca7-453e09365082', '2019-04-20 11:44:38', 8, '星澜汇是启迪协信在巴南打造的首个千亩生态宜居大盘，项目位于新龙洲湾高端居住区，容积率仅为1.75，也是集协信地产 24年高端住宅/商业/产业地产开发经验之打造150万方大城，塑造巴南低密度宜居生活标杆；项目自身配备了近 15 万方星光商业，10 万方的星光优家系商业。整个星澜汇供9000户，未来常驻人口约4-5万人，区域常驻人口80万人。', '2019-04-19 17:50:26', '946cddf4-065c-43a7-88d1-b2c39b024c4f', '2019-07-01 10:54:56', '00d11ef7-7d32-4551-bd51-d8858db72611', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('e19d78cd-fd7b-4962-9a2a-c273858dbabb', '重庆市北碚区蔡家嘉瑞大道188号', '500902', 1512, 5, 192932, '500000', '94104f24-4c22-4a95-a8bf-77b70ee9a9e1', '500900', 52831, 18, 173, '2059-09-24 00:00:00', 551.1500, 34.1400, '红星大都汇', '重庆红星物业管理有限公司', 12.0000, 1684, 40, 87, 2.5, '黄莉', '13883142010', 19.2000, '一手商铺销售', '2019-09-19 00:00:00', '2019-12-31 00:00:00', '商办项目', 85, 85, 0, 1, NULL, '106.49694702968054', '29.750774017136138', NULL, '106.490383', '29.745058', 18.950000, 151.930000, '2019/9/e19d78cd-fd7b-4962-9a2a-c273858dbabb/9eca26b7-24db-4918-a78f-8ee398b2ef4d_360_215_ICON_1.jpg', 8, '2019-08-24 16:50:19', '3b58adf3-bb61-4215-9ca7-453e09365082', '2019-09-24 16:50:19', 0, '项目位于蔡家嘉瑞大道和同源路的交汇处，总占地5.2万方，总体量19.2万方，分南北两个区修建，南面由红星美凯龙家居mall搭配北面玫瑰天街和铂寓组成，形成集吃喝玩乐购住于一体的综合性商业中心，填补目前蔡家集中型商业市场的空白。自持招商运营部分约13万方，占总体量的70%，主要布局美凯龙家具商场，其吸引蔡家低密度组团客群以及中央公园、礼嘉片区中高端客户到此选购家具，据目前主城开业的美凯龙统计每年约吸引超上百万的客流，玫瑰天街板块环抱家具MALL形成客流共享打造区域内及市场的商业配套从而完善定位为一站式消费圈。', '2019-09-23 10:35:09', '81077bf5-898f-451d-89cc-1c1d1d27dfb5', '2019-09-24 16:04:37', '81077bf5-898f-451d-89cc-1c1d1d27dfb5', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
