INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('E52BC0EF-5681-4B55-A24F-D046EC4A94AD', '重庆市两江新区公园公路', '500320', 1564, 21, 1920000, '500000', '0663c668-5579-4d6f-8485-aad4f52c3a55', '500300', 518466, 35, 1309, '2066-06-30 00:00:00', 402.5700, 52.6900, '中交中央公园', '重庆绿城物业管理有限公司', 6.0000, NULL, 50, 171, 2.71, '胡桃三', '13996214033', 192.0000, '一手商铺销售', '2019-04-01 00:00:00', '2019-09-30 00:00:00', '住宅', 103, 127, 21, 1, NULL, '106.59390058031141', '29.71427652261324', NULL, '106.587421', '29.708235', 9.110000, 342.390000, '2019/4/E52BC0EF-5681-4B55-A24F-D046EC4A94AD/9109D61C-DABB-4AC5-B007-BB312154519E_360_215_ICON_1.jpg', 8, NULL, '3b58adf3-bb61-4215-9ca7-453e09365082', '2019-04-11 17:35:44', 8, '       中交中央公园位于两江新区“黄金三角”核心区——“国际中心区”内，地处亚洲第一、世界第三大开放式城市公园——“中央公园”旁，是由世界500强中交建下属拥有绿城地产、中房地产双上市企业的中交地产倾力打造。\n       项目占地777.7亩，总建筑面积约192万方，项目规划住宅、商务、商业等全业态产品，定位打造成国际、时尚、艺术的大型城市综合体，在公共景观方面拥有中央公园以及市政公园，同时拥有区域内唯一镜湖水系，将为重庆开启世界级公园都会生活模式。\n       项目坐享轨道、航空、路网三维立体交通体系，四横四纵快速干道通达全城，多条轻轨线路布局，距离机场不到6公里，距离寸滩港约11公里，龙头寺火车站约12公里。\n       项目全生命周期国际化教育体系配套，在项目最核心地块内，规划两所国际双语幼儿园、一所小学和一所中学，以最优厚的条件引进重庆优质教育资源。项目打造约30万方特色都会商业，都会shopping mall、滨水风情商业街、格调街区商业三大体系商业布局，打造充满国际、时尚、艺术的繁华生活典范。', '2019-04-05 17:20:17', '946cddf4-065c-43a7-88d1-b2c39b024c4f', '2019-07-18 10:42:55', '946cddf4-065c-43a7-88d1-b2c39b024c4f', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('e6743e9d-0bc5-49ec-938b-d0289c39bf03', '郑州市二七区京广南路与长江路交汇处东南', '1000403', 4200, 17, 1200000, '1000000', '1564e049-6b66-4f54-ae1c-412728901d7a', '1000400', 250670, 39, 5480, '2082-07-30 00:00:00', 0.0000, 0.0000, '长江一号', '郑州多元物业管理有限公司', 5.0000, NULL, 70, 800, 3.03, '王冬林', '13140127556', 120.0000, '一手商铺交易', '2019-03-20 00:00:00', '2019-12-31 00:00:00', '住宅', 0, 1, 1, 1, NULL, '113.66677246983708', '34.71390236515619', NULL, '113.660304', '34.70773', 24.210000, 24.210000, '2019/8/e6743e9d-0bc5-49ec-938b-d0289c39bf03/e5f6051d-df04-4509-8fa1-5d2144b26c2e_360_215_ICON_1.jpg', 8, NULL, '0170817f-902e-42e6-8ab1-7e8a126ddd0a', '2019-08-05 11:42:22', 8, '长江一号项目位于郑州市二七区京广快速路与长江路交汇处，北起长江路，南至赣江路，东临碧云路，西接南溪路，城市主干道京广快速路贯穿其中。项目东西跨度1.1公里，南北长约860米，占地约376亩，地上建筑面积近120万平方米，住宅部分达到80万平方米近6000户，配套建设的商业部分近37万平方米，建成后的长江一号将成为一个集居住、购物、餐饮、娱乐、商务和公共活动为一体的国际标准城市综合型社区。', '2019-08-05 09:43:56', 'e2752883-77bc-4eea-951d-d44756e21a95', '2019-08-05 11:42:22', 'e2752883-77bc-4eea-951d-d44756e21a95', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
