INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('EC83CD49-518E-46FE-94FC-700A1FDE9A50', '重庆市沙坪坝区西永街道西尊路重庆融创万达文化旅游城', '500511', 62163, 589, 5500000, '500000', '8d8bcfb3-e871-4e2a-9f09-739ffdf449c8', '500500', 4462200, 30.08, 4986, '2067-12-04 00:00:00', 200.4400, 30.5600, '融创重庆文旅城', '融创物业服务集团有限公司', 5.5000, 70930, 40, 1896, 2.2, '张科雪', '13512343237', 550.0000, '一手商铺销售', '2018-09-23 00:00:00', '2019-05-31 00:00:00', '文旅', 88, 324, 233, 1, NULL, '106.35797421834354', '29.63010649785154', NULL, '106.351482', '29.624135', 18.920000, 129.480000, '2019/9/EC83CD49-518E-46FE-94FC-700A1FDE9A50/de1bd04c-17c7-449a-90a1-7dfd76d40037_360_215_ICON_1.jpg', 8, '2019-08-26 09:55:17', '3b58adf3-bb61-4215-9ca7-453e09365082', '2019-04-14 10:14:59', 8, '重庆融创万达文化旅游城是万达最新建设的一个文旅城，以打造世界级文化旅游目的地为最终目标。总投资近550亿元 。建成后，将成为一个集文化、旅游、休闲、商业、生活于一体的新的城市旅游中心。重庆万达文旅城将有别于其他城市的类似项目，主要体现在对重庆文化的融合上，例如万达文旅城的一个展示中心，将以重庆市花——山茶花为主题，而其他的很多建筑也会融入重庆元素。在体验上，会更多地融入重庆的本土文化，例如在舞台秀上，将考虑融入重庆的抗战文化、码头文化、巴渝文化等内容，在商业体的打造上，融入重庆的饮食文化等，让前往万达文旅城的游客，能够清晰地感受到重庆独有的文化符号。重庆万达文旅城的正式落户，未来这一大型文旅平台，项目将催生和促进多种现代服务业态的发展繁荣，有望成为重庆市文化旅游的又一张新名片。\n定位：重庆文化旅游城是万达集团在商业、文化、旅游产业上的集大成者，以创新的手法将世界顶尖商业、地域文化和旅游观光相结合，独创世界首个特大型文化旅游综合地标。\n区域：本项目位于重庆西部新城—沙坪坝西永，重庆西部新城是重庆市政府重点打造的三大新区之一，同时也是发展增速最快、发展格局最好的新区。主要由四大板块组成，中国建设最完善的西部教育中心—重庆大学城（汇集了重庆大学、重庆师范大学及重庆医科大学等15所高等学府，聚集来自全球各地超20万师生），西部高新技术产业中心—西永微电子产业园（已吸引惠普、富士康、广达、英业达等世界级500强及配套厂商140余家企业入驻），西部交通物流中心—西部现代物流园（肩负“一带一路”战略节点、“渝新欧”国际贸易大通道起点、西南保税物流分拨中心、中新（重庆）战略互联互通示范项目以及内陆地区铁路枢纽口岸使命，打造产值超3000亿元的现代商贸物流新城），以及西永都市核心区，纵观全重庆，汇集万达、龙湖、金科、恒大、协信等全国百强房密集扎堆的地方，也只有西部新城西永核心区了，众多开发商共聚于此，由此可见西永核心区的区域价值了。除此以外西部新城还是“渝新欧铁路”的起点和“一带一路”战略节点，未来的发展前景不可限量，是重庆投资的热土。\n交通：未来整个新城规划的交通也极为便利。西永将形成“4轨5桥6隧”的立体交通网络。已开通的1号线（将会把大量的解放碑游客快速导入本区域），规划中的7号线（双福到北碚），13号线（大学城—国博中心）及17号线（西永—江津），未来九龙坡、大渡口及渝中区的市民可通过乘坐这4条轨道交通直接抵达项目，同时通过与1/6/10号线的无缝换乘，也方便了江渝北片区的市民。如果自驾游到项目，全市人民可通过石门大桥、高家花园大桥走大学城隧道或通过双碑大桥过双碑隧道快速到达。2018年1.18日正式动工修建的礼嘉大桥和土主隧道，将于2021年建成通车，届时北碚、两江新区等市民到达项目旅游最快只需20分钟。此外随着万达城的入驻，沙区政府在着力推进大竹林大桥、高家花园复线桥、井口隧道、西永隧道及大学城复线隧道的修建。同时新城还围绕着内环、绕城、渝蓉、渝遂、成渝等5线，连通主城各区及成都、贵州、云南等西南三省。有这“4轨5桥6隧”及5线作为交通保障，未来重庆万达文化旅游城将成为代言重庆，辐射西南三省的旅游目的地。', '2018-11-26 20:43:30', '946cddf4-065c-43a7-88d1-b2c39b024c4f', '2019-09-26 09:55:17', '81077bf5-898f-451d-89cc-1c1d1d27dfb5', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
