INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('f035c96f-cfcb-421c-b568-4356e89eac69', '杭州市上城区老浙大横路31号', '710301', NULL, 1, 11681, '710000', 'c39b61c8-bbb6-4047-8c86-0948d731d908', '710300', 3372, NULL, 188, '2042-09-11 00:00:00', 277.6900, 150.9600, '格林公馆', '待定', 6.0000, NULL, 40, 188, 3.5, '熊敏', '18358156996', 1.1000, NULL, '2019-09-01 00:00:00', '2019-12-31 00:00:00', '公寓', 109, 109, 0, 1, NULL, '120.19088179375746', '30.260080623927983', NULL, '120.18428', '30.254428', 43.130000, 79.340000, '2019/9/f035c96f-cfcb-421c-b568-4356e89eac69/417d23ea-cc7c-474e-9366-21a3385a8f5e_360_215_ICON_1.jpg', 8, '2019-08-11 09:57:45', 'ff601870-c85e-453a-8d33-35f7da193115', '2019-09-11 09:57:45', 0, '格林公馆，项目位于庆春路、浙一旁、杭城中心、西湖东3公里、八大医院集中地，西湖精装私寓。处于真正的黄金地段、真正的市中心、真正的地铁环绕，西面临5号线万安桥站仅300米、北面临2号线庆菱路站仅900米、南面临1号线城站仅1500米、东面靠4号线钱江路站。比邻浙一、浙二、市一、市三、邵逸夫、红会医院、妇保、老儿保八大省市级医院。周边重点学校扎堆，采荷一小、采荷二小、青蓝小学、刀茅巷小学、采荷中学、春雷中学（王马校区）、浙江大学（华家池校区）等，合计周边学生数2.5万人，陪读父母数量可观，拥有庞大的一家三口高品质租住需求量。“华尔街”庆春路，高精尖人群密度最高区域之一，本项目3km辐射范围内多大十余个高端写字楼至少有2万白领人士及金融精英，周边武林商圈、龙翔桥、庆春商圈、以及钱江新城等商圈环伺，生活所需一应俱全，成熟配套。格林公馆，公寓产品综合价值体现的集大成者，满足多元化出租需求，投资前景无可限量。', '2019-09-03 16:52:31', '0d00320f-2389-43e5-8cc0-d768792d1e68', '2019-09-11 09:48:36', '0d00320f-2389-43e5-8cc0-d768792d1e68', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('F4650506-52C7-4FB8-808F-FC0DA5C8F5FC', '重庆市长寿区桃花新城桃源东路1号', '501020', 2291, 50, 450000, '500000', '2707b6aa-dc50-45c8-9669-6e9775e87932', '501000', 175777, 30, 15000, '2050-07-26 00:00:00', 584.6800, 31.8200, '渤能中央公园', '重庆北洋物业管理有限公司', 3.0000, NULL, 40, 259, 2.1, '吴方', '17723171513', 45.0000, '一手商铺销售', '2019-05-14 00:00:00', '2019-08-14 00:00:00', '商铺', 173, 178, 4, 1, '2707b6aa-dc50-45c8-9669-6e9775e87932', '107.0834632993586', '29.862854640052166', NULL, '107.076949', '29.856974', 19.320000, 520.800000, '2019/5/F4650506-52C7-4FB8-808F-FC0DA5C8F5FC/82983F45-FFDD-49CA-8FA6-A11EB1993140_360_215_ICON_1.jpg', 8, NULL, '3b58adf3-bb61-4215-9ca7-453e09365082', '2019-05-25 11:01:30', 8, '长寿渤能中央公园位于重庆市长寿区桃花新城中心地段，紧邻长寿区政府，三面被400多亩桃花公园所环绕，打造的是“隐于市，藏于园的”公园墅级住区。总占地面积约17万方，总建筑面积约40多万方，整体容积率仅为2.09，打造的是集别墅、洋房、高层、商业为一体的高端低密度的中央墅级住区。在建筑外立面上，采用的是法式新古典风格，造型上强调建筑的层次丰富多变，面材上注重运用米黄色天然石材、真石漆等材料，体现出浓厚的人文主义气息，给人以舒展、华贵、稳重、大气、内敛之感。在规划上，中央公园采用的是人车分流的设计，共规划室内停车位2000多个。在园林景观设计上，分别以五种不同的主题形成不同的园林景观风格进行打造。此外，中央公园藏身于桃花公园里，城市的阔景豪迈，公园的迤逦风景，宅间景观的精巧雅致，不同意境的风景在此融合，给人以无限的遐想。中央公园坐拥多元交通，出行畅通无阻，3分钟左右的时间即可享受桃花新城行政中心、商业中心的大配套，4分钟左右的时间即可到达长寿古镇商圈，5分钟左右的时间可畅达北部新区和长寿火车北站及城际高铁站，8分钟左右的时间直达老城区。', '2019-05-23 11:34:09', '946cddf4-065c-43a7-88d1-b2c39b024c4f', '2019-07-01 11:28:59', '00d11ef7-7d32-4551-bd51-d8858db72611', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
