INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('f7445ecd-4ef5-4a3c-82cb-ba55c6a76a37', '栖霞燕子矶街道太新路与燕园路交汇处', '700504', 2266, 15, 220308, '700000', '168369c0-e490-44ae-92ba-24789e6cefcc', '700500', 68846, 30, 1882, '2055-08-28 00:00:00', 1738.4000, 618.3600, '保利国际社区', '中航物业管理有限公司', 6.3000, NULL, 40, 210, 3.2, '盛云龙', '15852917570', 22.0000, '一手商铺销售', '2019-07-01 00:00:00', '2019-09-30 00:00:00', '住宅', 7, 7, 0, 1, NULL, '118.83367924960159', '32.14546713731602', NULL, '118.82721', '32.139419', 39.000000, 174.000000, '2019/8/f7445ecd-4ef5-4a3c-82cb-ba55c6a76a37/ca255375-d689-4a2f-934e-5762d68bdd56_360_215_ICON_1.jpg', 8, '2019-09-08 10:39:15', '76145e5c-08f5-4621-b526-5af123636420', '2019-08-05 16:51:41', 8, '中航国际社区是中航进南京的第6个项目，是区域内首个地价破万元的地王，也是目前区域内最大最完整的地块，建成后必将是本区域内标杆之作。项目占地约6.88万㎡，总建面积约22.8万㎡，容积率3.2，规划由15幢高层及2.2万㎡沿街商铺组成的，打造TOP系高品质人文社区。\n以售楼处为原点，小区分为南北两期开发，南侧为B地块，北侧为A地块。与周边项目相比，项目有5大最特别之处：最纯粹的中式围合布局最纯粹、安全的人车分流最国际化的建筑形态最具情怀的景观理念(风雨连廊)最全龄的活动场所(其中包括南京最大社区儿童乐园)。											\n', '2019-08-05 15:55:39', '7a5db1ea-828c-4c9a-9758-188a9a113776', '2019-10-08 10:39:15', '7a5db1ea-828c-4c9a-9758-188a9a113776', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
