INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('fa3cb91b-a435-43ff-848b-04fab7caab4c', '南京市江宁区启迪大街188号', '700810', 4411, 35, 152227, '700000', 'ecf4ed24-c446-4e48-b03c-508a3f746e0a', '700800', 39066, 33, 1116, '2052-01-10 00:00:00', 1222.4900, 203.1500, '启迪方洲', '南京启迪物业管理有限公司', 5.0000, NULL, 40, 136, 3.1, '芮之', '13951938088', 15.0000, '一手商铺销售', '2019-08-07 00:00:00', '2019-12-31 00:00:00', '住宅', 39, 41, 2, 1, NULL, '118.91258002762895', '32.032652414265094', NULL, '118.906164', '32.02639', 47.650000, 503.750000, '2019/8/fa3cb91b-a435-43ff-848b-04fab7caab4c/c95bbe77-c760-434f-a500-3a1546b2dedf_360_215_ICON_1.jpg', 8, '2019-07-13 14:27:38', '76145e5c-08f5-4621-b526-5af123636420', '2019-08-13 14:18:08', 8, '清华科技园始建于1994年，是我国较早建立的大学科技园，也是科技部、教育部评定的A类大学科技园。清华科技园的运营单位是启迪控股股份有限公司。\n　　启迪方洲是麒麟清华科技园的住宅部分，项目位于南京市主城区东部的麒麟科技创新园，南至钟学北路、东至东麒路，距新街口直线距离约10公里左右。有轨电车开通后，可与地铁形成双轨交通。\n　　启迪方洲东边紧邻项目内幼儿园，南边经过天然湖泊彩虹湾，远眺青龙山生态长廊，西边紧靠20万商业综合体，北边靠近有过电车科技园站和天泽路站，远看南京千古名山紫金山。朗园南面是清华科技园的科技产业孵化器，大部分建筑为7层以下，站在客厅和卧室就可以纵览青龙山景观，让生活更加惬意舒适。', '2019-08-13 11:47:10', '7a5db1ea-828c-4c9a-9758-188a9a113776', '2019-08-13 14:27:38', '7a5db1ea-828c-4c9a-9758-188a9a113776', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
