INSERT INTO `xkj_fy_buildingbaseinfos` VALUES ('fcb64079-da1b-4b81-b832-2c763e18e5fe', '重庆市北碚区蔡家轻轨6号线曹家湾站旁', '500902', 2715, 29, 400000, '500000', 'f482205e-c2b5-462b-bea7-55e73e27886b', '500900', 114000, 30, 3200, '2058-07-01 00:00:00', 54.1400, 42.7000, '中南玖宸', '中南物业有限公司', 2.6000, NULL, 40, 476, 2.5, '张帅', '15808062426', 40.0000, '一手公寓销售', '2019-07-01 00:00:00', '2019-12-31 00:00:00', '公寓', 157, 476, 314, 1, 'f482205e-c2b5-462b-bea7-55e73e27886b', '106.49385070800781', '29.730958938598633', NULL, '106.487299', '29.725216', 40.850000, 49.890000, '2019/7/fcb64079-da1b-4b81-b832-2c763e18e5fe/5f316b7e-17ea-42c3-8a9a-951323db24f1_360_215_ICON_1.jpg', 8, NULL, '3b58adf3-bb61-4215-9ca7-453e09365082', '2019-07-14 00:47:54', 8, '中南玖宸由中国房企TOP20【中南置地】倾力打造，项目位于两江新区核心区蔡家片区，优质城市资源、经济政策红利高度聚集，享嘉陵江湾区江景，生态公园资源丰富。轨道6号线曹家湾出站即达项目，快速贯通观音桥、渝中半岛等各大商圈；4公里范围内覆盖重庆国际博览中心旭辉嘉悦广场、瀚洋百货、佳程广场、中央大街，再加上项目自有10万方区域级商业中心，出入皆享24小时不落幕的繁华。名校/医院近在咫尺，人民路小学、兼善中学、西师附中，重庆嘉瑞医院、重庆瑞慈医院汇聚项目周边，读名校无需跨区远行，赢在教育起跑线；享医疗近在不远处，生活省心又安心。约17万方蔡家五彩滨江公园依傍，加之举人楼公园、樱花公园、观音岩湿地公园环伺，花香四溢的夜跑场、孩子的自然游乐园、爸妈的清新晨练地，与自然的亲密接触仅一步之遥。中南玖宸，规划总建筑面积约40万方，住宅容积率仅2.5，由云景高层、全景洋房、轻资LOFT、情景商业组成的“健康TED社区”，中南置地深耕全国三十余载，以繁华造都心，用美好致生活，树重庆健康宜居新典范。', '2019-07-14 00:32:19', '946cddf4-065c-43a7-88d1-b2c39b024c4f', '2019-07-29 11:58:16', '946cddf4-065c-43a7-88d1-b2c39b024c4f', NULL, NULL, 0, '|商铺|', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
